#
# Structure for table "currency_shop_order"
#

DROP TABLE IF EXISTS `currency_shop_order`;
CREATE TABLE `currency_shop_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  `order` varchar(255) NOT NULL COMMENT '订单号',
  `total_money` varchar(255) DEFAULT NULL COMMENT '总价格',
  `number` int(11) NOT NULL COMMENT '数量',
  `time` varchar(32) DEFAULT NULL COMMENT '时间',
  `status` int(11) DEFAULT NULL COMMENT '订单状态 1已付款 2已发货 3已收货',
  `logistics_id` int(11) DEFAULT NULL COMMENT '物流id',
  `ship_id` int(11) DEFAULT NULL COMMENT '收货地址id',
  `cmc` float(11,2) NOT NULL COMMENT '购买报单产品时CMC的价格',
  `product_img` varchar(255) DEFAULT NULL COMMENT '产品图片',
  `product_price` float(11,2) DEFAULT NULL COMMENT '产品价格',
  `product_name` varchar(255) DEFAULT NULL COMMENT '产品名称',
  `method` int(1) DEFAULT NULL COMMENT '支付方式 1余额账户 2报单支付 3 红包重消 4积分',
  `product_type` int(1) DEFAULT NULL COMMENT '所属商城 1红包商城 2积分商城 3重消商城',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=utf8 COMMENT='商城订单表';

