# Structure for table "currency_sms_cfg"
#

DROP TABLE IF EXISTS `currency_sms_cfg`;
CREATE TABLE `currency_sms_cfg` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sign` varchar(255) NOT NULL COMMENT '签名',
  `template` varchar(255) DEFAULT NULL COMMENT '模板编号',
  `outid` varchar(255) DEFAULT NULL COMMENT '流水号',
  `extendcode` varchar(255) DEFAULT NULL COMMENT '短信扩展码',
  `access_key_id` varchar(255) DEFAULT NULL COMMENT 'AKid',
  `access_key_secret` varchar(255) DEFAULT NULL COMMENT 'AKsecret',
  `expire` int(11) DEFAULT '5' COMMENT '验证码失效时间 单位分钟',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='短信配置';

