DROP TABLE IF EXISTS `currency_text`;
CREATE TABLE `currency_text` (
  `id` int(50) unsigned NOT NULL AUTO_INCREMENT,
  `xnbid` int(11) DEFAULT '0',
  `type` int(20) NOT NULL COMMENT '类型',
  `label` varchar(255) DEFAULT NULL COMMENT '标签',
  `title` varchar(255) NOT NULL COMMENT '标题',
  `brief` tinytext NOT NULL COMMENT '文章简介',
  `header` tinyint(5) NOT NULL COMMENT '头部显示',
  `footer` tinyint(5) NOT NULL COMMENT '底部显示',
  `text` text NOT NULL COMMENT '内容',
  `addtime` int(50) NOT NULL COMMENT '添加时间',
  `endtime` int(50) NOT NULL COMMENT '更新时间',
  `sort` int(50) NOT NULL COMMENT '排序',
  `status` tinyint(3) NOT NULL DEFAULT '1' COMMENT '是否禁用',
  `admin` varchar(255) NOT NULL COMMENT '发布人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=274 DEFAULT CHARSET=utf8 COMMENT='文章';

