t\t</p>\r\n\t\t<div class=\"img_src\" style=\"margin-left:-15px;\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c0cdd6cce6.jpg\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t<li style=\"text-align:justify;color:#666666;\">\r\n\t\t<p>\r\n\t\t\t注册成功。登录账户后即可直接进行充值并交易。\r\n\t\t</p>\r\n\t\t<div class=\"img_src\" style=\"margin-left:-15px;\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c27433423b.jpg\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t\t</ol>',1500713708,1510745935,0,1,'农畜商品交易平台'),(43,0,6,'','交易指南','交易指南',1,1,'<strong>首先，进入农畜商品交易平台首页，登录已有账号，点击进入【交易中心】页面，该页面将显示农畜交易平台上所有产品，选择您想交易的产品，如图：</strong> \r\n<div class=\"img_src\">\r\n\t<img src=\"/Uploads/Editor/2017-11-15/5a0c0dfb91074.png\" alt=\"\" /><br />\r\n</div>\r\n<div class=\"img_src\">\r\n\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2d9c548c0.png\" alt=\"\" /><br />\r\n</div>\r\n<div id=\"buyGuide\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t买入指南\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2dae41d69.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t点击进入交易页面后，在买入栏中填入【买入价格】【买入数量】【交易密码】，点击【买入】。系统将自动成交挂单。\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：买入数量应小于等于【最大可买】。</span><br />\r\n<span>买入数量不能小于0.1；成交金额不能少于10元。</span><br />\r\n<span>不同农畜的买入手续费不同，请买入前仔细确认金额。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0bb53eb2a3a.jpg\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t挂单成功后，可在【财务中心】-【委托管理】中查询挂单委托情况。\r\n\t\t\t</p>\r\n\t\t\t<p>\r\n\t\t\t\t<span class=\"notice\">注：若挂单价格与当前市价不吻合，可能导致挂单不能及时成交。可稍作等待，观察行情。若挂单仍未成交，可撤销（交易中心-我的委托挂单-撤销）挂单调整价格重新挂单。撤销后，未成交部分资产（如购买时冻结的资金、卖出时冻结的资金）将原数返还到您的平台账户中。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2dc4263b4.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t也可在【财务中心】-【成交查询】中查询挂单成交情况。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2ddf9dcb5.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t挂单成交后，请刷新页面，点击【财务中心】查看资产变化。\r\n\t\t\t</p>\r\n\t\t\t<p>\r\n\t\t\t\t<span class=\"notice\">如有挂单其他问题，可咨询在线客服。</span> \r\n\t\t\t</p>\r\n\t\t</li>\r\n\t</ol>\r\n</div>\r\n<div id=\"sellGuide\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t卖出指南\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2dea5571c.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t点击进入交易页面后，在卖出栏中填入【卖出价格】【卖出数量】【交易密码】，点击【卖出】。系统将自动成交挂单。\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：卖出数量应小于等于【最大可买】。 买入数量不能小于0.1；成交金额不能少于10元。 不同农畜的买入手续费不同，请买入前仔细确认金额。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2e609fca9.jpg\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t也可在【财务中心】-【委托管理】中查询挂单成交情况。\r\n\t\t\t</p>\r\n\t\t\t<p>\r\n\t\t\t\t<span class=\"notice\">注：若挂单价格与当前市价不吻合，可能导致挂单不能及时成交。可稍作等待，观察行情。若挂单仍未成交，可撤销（交易中心-我的委托挂单-撤销）挂单调整价格重新挂单。撤销后，未成交部分资产（如购买时冻结的资金、卖出时冻结的资产）将原数返还到您的平台账户中。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2e7772234.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t也可在【财务中心】-【成交查询】中查询挂单成交情况。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2e8586a2d.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t挂单成交后，请刷新页面，点击【财务中心】查看资产变化。\r\n\t\t\t</p>\r\n\t\t\t<p>\r\n\t\t\t\t<span class=\"notice\">如有挂单其他问题，可咨询在线客服。</span> \r\n\t\t\t</p>\r\n\t\t</li>\r\n\t</ol>\r\n</div>',1500714205,1510881343,0,1,'区块链'),(44,0,6,'','充值指南','充值指南',1,1,'<div id=\"cardRechargeGuide\">\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c32e00cb27.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t首先，进入平台首页，登录已有账号，点击【去财务中心】或在导航栏选择【财务中心】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c330073f6d.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t在页面左侧菜单选择【人民币充值】。若未绑定银行卡，点击【绑定银行卡】按钮，先绑定银行卡。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c331f44047.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t在【安全中心】--【绑定银行卡】页面，点击【添加一个地址】按钮，进行银行卡绑定。如已绑定银行卡，请忽略此步骤。\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：汇款人姓名默认为实名认证的姓名，仅允许使用本人的银行进行转账充值。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c33373f7f3.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t\t<p>\r\n\t\t\t\t银行卡绑定成功后的页面如下图：\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c335b70b36.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t进入【财务中心】--【人民币充值】页面，填写充值金额后，点击【确认】按钮。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c337361c26.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t页面弹出平台的收款账号及汇款信息，请根据“银行转账汇款”信息通过网银、去银行柜台或使用支付宝进行转账汇款。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c34f690821.jpg\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t银行转账成功后，平台会在收到汇款后30分钟内入账。请及时刷新页面，并查看资产。 若转账后超过30分钟仍未入账，请联系在线客服。\r\n\t\t\t</p>\r\n\t\t</li>\r\n\t</ol>\r\n</div>\r\n<div id=\"rechargeRange\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t银行充值限额表\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c339f78978.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n</div>',1500714597,1510881431,0,1,'区块链'),(45,0,6,'','提现指南','提现指南',1,1,'<div class=\"img_src\">\r\n\t<img src=\"/Uploads/Editor/2017-11-15/5a0c375f4cad3.jpg\" alt=\"\" /><br />\r\n</div>\r\n<ol>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t进入农畜商品交易中心首页，登录已有账号，点击【去财务中心】或在导航栏选择【财务中心】，如图：\r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2f25950ce.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t人民币提现操作需绑定用户本人的银行卡，绑定银行卡流程可参考【充值指南】页面。若已绑定可直接申请提现。\r\n\t\t</p>\r\n\t\t<p class=\"notice\">\r\n\t\t\t<span>注1：姓名栏，系统默认为实名认证姓名。 </span> <span>若此处的姓名与本人真实姓名不符，请联系在线客服。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span class=\"notice\">注2：提现金额单笔最低可申请100元，最高50000元。提现手续费率为提现金额的0.5％，每笔提现最低收费2元。</span> \r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Public/Home/images/help_center/recharge_images/tixian1.jpg\" alt=\"流程图\" /> \r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t人民币提现申请提交成功后，如下图：\r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Public/Home/images/help_center/recharge_images/tixian2.png\" alt=\"流程图\" /> \r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t申请提现后，财务会在24小时之内处理提现。请耐心等待并随时关注银行账户资金变动。若超过24小时仍未到账，请联系在线客服。\r\n\t\t</p>\r\n\t</li>\r\n</ol>',1500714727,1510881483,0,1,'区块链'),(46,0,6,'','转入/转出资产指南','转资产指南',1,1,'<p>\r\n\t<strong>首先，进入农畜商品交易中心首页，登录已有账号，点击【去财务中心】或在导航栏选择【财务中心】，如图：</strong> \r\n</p>\r\n<div class=\"img_src\">\r\n\t<div>\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c299299544.png\" alt=\"\" /> \r\n\t</div>\r\n</div>\r\n<div id=\"transferIn\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t转入资产（以CMC为例）\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c38c46a83d.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t进入财务中心，点击【转入<span>资产</span>】，选择CMC，输入转入数量和交易密码，点击【确认】按钮。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2018-01-12/5a587cceba5f5.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t提交成功后，页面显示CMC在农畜商品交易中心上的钱包地址，将CMC转入该钱包即可。\r\n\t\t\t</p>\r\n\t\t\t<p>\r\n\t\t\t\t也可通过手机扫描右侧的【CMC钱包地址】二维码，获取钱包地址。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2018-01-12/5a587ce1295da.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t请确认已达到确认数后，刷新页面，点击【财务中心】查看资产变化。\r\n\t\t\t</p>\r\n\t\t\t<p>\r\n\t\t\t\t可在转入记录中查询转入具体情况，如图：\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：如遇转入未到账等问题，可咨询在线客服。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2018-01-12/5a587cf77905f.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t</ol>\r\n</div>\r\n<div id=\"transferOut\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t转出资产(以转出CMC为例)\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c38daaf27b.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t进入财务中心，点击【转出资产】，选择CMC，输入转出信息，包括钱包地址（将CMC转入的钱包地址）、转出数量（应少于等于可用CMC数量）、交易密码及手机验证码。确认无误后，点击【提交】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2018-01-12/5a587d130cc3f.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t请等待客服人员确认转出。可在转出记录中查询转入具体情况，如图：\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：如有其他问题，请咨询在线客服。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2018-01-12/5a587d229e3f3.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t</ol>\r\n</div>',1500714778,1515748653,0,1,'admin'),(47,0,6,'','手机绑定指南','手机绑定指南',1,1,'<p>\r\n\t<span style=\"line-height:1;\"><strong>首先，进入农畜商品交易中心首页，登录已有账号，点击进入【安全中心】页面，如图：</strong></span> \r\n</p>\r\n<div class=\"img_src\">\r\n\t<img src=\"/Uploads/Editor/2017-11-15/5a0c34de4f2da.png\" alt=\"\" /><br />\r\n</div>\r\n<div id=\"phonebind\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t绑定手机\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c36132ee5e.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t进入【安全中心】，在页面左侧菜单选择【手机绑定】，输入常用手机号、手机验证码，点击【手机绑定】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<span id=\"__kindeditor_bookmark_start_11__\"></span><img src=\"/Uploads/Editor/2017-11-15/5a0c352416c98.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t绑定成功。当进行转出虚拟币、人民币提现等操作时，需要手机验证码。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c341632fcb.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t</ol>\r\n</div>\r\n<div id=\"phoneunbind\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t解除手机绑定\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Public/Home/images/help_center/telphoneunbind.jpg\" alt=\"流程图\" /> \r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t进入【安全中心】，在页面左侧菜单选择【手机绑定】，输入手机验证码，点击【解除绑定】\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c34826e832.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t手机解除绑定\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：为保障账户资金安全，建议解绑手机后及时绑定手机。若有其他问题，请资讯在线客服.</span> \r\n\t\t\t</p>\r\n\t\t</li>\r\n\t</ol>\r\n</div>',1500714824,1510881642,0,1,'区块链'),(48,0,6,'','实名认证修改指南','实名认证修改指南',1,1,'<strong>根据相关法规，在<span style=\"color:#000000;font-family:\" font-size:13px;background-color:#1a1c28;\"=\"\"><span style=\"font-family:\" font-size:13px;background-color:#1a1c28;\"=\"\">农畜产品交易平台</span></span>注册的用户必须进行身份认证并保证信息的真实合法性，认证成功后原则上不允许更改，若有特殊情况需要更改请联系星币官方客服。具体步骤如下：</strong> \r\n<div class=\"img_src\">\r\n\t<img src=\"/Uploads/Editor/2017-11-15/5a0c2ba6f03a8.jpg\" alt=\"\" /><br />\r\n</div>\r\n<ol>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t打开<span style=\"font-family:\" font-size:13px;background-color:#1a1c28;\"=\"\">农畜产品交易平台</span>，登录已有账号，点击【在线客服】。\r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c3783dd46a.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t请用户本人联系客服，客服人员会帮助用户进行取消实名认证操作。\r\n\t\t</p>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t取消实名认证后，用户须在【安全中心】-【实名认证】页面，点击“马上去认证”，重新进行照片认证，如图：\r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c3024860a7.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t认证成功后，可在【实名认证】页面查看本人的身份信息。\r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span class=\"notice\">客服在线：（9:00-18:00）</span>\r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c3832b5f03.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n</ol>',1500714957,1510881711,0,1,'区块链'),(49,0,6,'','登录密码重置指南','登录密码重置指南',1,1,'<div id=\"findenterPw\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t找回登录密码\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t&nbsp; &nbsp;<img src=\"/Uploads/Editor/2017-11-17/5a0e3a9ae7c2b.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t打开农畜商品交易平台首页，在登录框右下方，点击【忘记密码】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c329011351.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t选择【手机找回】或者【邮箱找回】，输入注册账号及验证码，点击【找回密码】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Public/Home/images/help_center/pw_images/pw_img5.jpg\" alt=\"流程图\" /> \r\n\t\t\t</div>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Public/Home/images/help_center/pw_images/pw_img6.jpg\" alt=\"流程图\" /> \r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t在找回密码页面输入新登录密码，并确认，点击【修改密码】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c36bfe15ba.jpg\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t修改成功。登录账户后即可直接进行充值并交易。\r\n\t\t\t</p>\r\n\t\t</li>\r\n\t</ol>\r\n</div>\r\n<div id=\"changeenterPw\">\r\n\t<div class=\"small_title\">\r\n\t\t<p>\r\n\t\t\t修改登录密码\r\n\t\t</p>\r\n\t</div>\r\n\t<div class=\"img_src\">\r\n\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c374924519.jpg\" alt=\"\" /><br />\r\n\t</div>\r\n\t<ol>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t打开平台首页，登录已有账号，点击【安全中心】。\r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c386818881.png\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t在页面左侧菜单选择【修改密码】--【修改登录密码】，按页面提示输入旧登录密码+新登录密码+确认新登录密码，点击【保存】即可。\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：登录密码格式为字母开头的6-18位组合。</span> \r\n\t\t\t</p>\r\n\t\t\t<div class=\"img_src\">\r\n\t\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c388041110.jpg\" alt=\"\" /><br />\r\n\t\t\t</div>\r\n\t\t</li>\r\n\t\t<li>\r\n\t\t\t<p>\r\n\t\t\t\t修改成功。请重新登录。\r\n\t\t\t</p>\r\n\t\t\t<p class=\"notice\">\r\n\t\t\t\t<span>注：若有其他问题，可咨询在线客服。</span> \r\n\t\t\t</p>\r\n\t\t</li>\r\n\t</ol>\r\n</div>',1500715069,1510881959,0,1,'区块链'),(50,0,6,'','交易密码重置指南','交易密码重置指南',1,1,'<div class=\"img_src\">\r\n\t<span id=\"__kindeditor_bookmark_start_10__\"></span>&nbsp;&nbsp;&nbsp;&nbsp;<img src=\"/Uploads/Editor/2017-11-15/5a0c2cb3084e0.png\" alt=\"\" /><br />\r\n</div>\r\n<ol>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t打开农畜商品交易平台首页，登录已有账号，点击【安全中心】。\r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c30ca732c5.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t在页面左侧菜单选择【修改密码】，点击选择【修改交易密码】，按页面提示输入旧密码＋新交易密码+确认新交易密码，点击【保存】即可。\r\n\t\t</p>\r\n\t\t<p class=\"notice\">\r\n\t\t\t<span>注：交易密码格式为6位纯数字。</span> \r\n\t\t</p>\r\n\t\t<div class=\"img_src\">\r\n\t\t\t<img src=\"/Uploads/Editor/2017-11-15/5a0c31c7e4370.png\" alt=\"\" /><br />\r\n\t\t</div>\r\n\t</li>\r\n\t<li>\r\n\t\t<p>\r\n\t\t\t修改成功，请牢记新交易密码，以免影响挂单交易。\r\n\t\t</p>\r\n\t</li>\r\n</ol>',1500715242,1510748640,0,1,'区块链'),(51,0,6,'','API','API',1,1,'<ol class=\"guide_index\" style=\"background-color:#F8F8F8;color:#333333;font-family:\" font-size:14px;\"=\"\">\r\n<li style=\"text-align:justify;color:#666666;\">\r\n\t<p>\r\n\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#user_instruction\">API使用说明(索引链接)</a> \r\n\t</p>\r\n\t<ul>\r\n\t\t<li style=\"text-align:justify;\">\r\n\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#request_info\">请求过程说明</a> \r\n\t\t</li>\r\n\t\t<li style=\"text-align:justify;\">\r\n\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#safe_ident\">安全认证</a> \r\n\t\t</li>\r\n\t\t<li style=\"text-align:justify;\">\r\n\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interface_api\">接口</a> \r\n\t\t\t<ol>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_1\">获取当前最新行情 - Ticker</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_2\">市场深度 - Depth</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_3\">最近的市场交易 - Orders</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_4\">获取所有币种最新行情 - AllTicker</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_5\">账户信息 - Account Balance</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_6\">挂单查询 - Trade_list</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_7\">查询订单信息 - Trade_view</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_8\">取消订单 - Trade_cancel</a> \r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#interF_9\">下单 - Trade_add</a> \r\n\t\t\t\t</li>\r\n\t\t\t</ol>\r\n\t\t</li>\r\n\t\t<li style=\"text-align:justify;\">\r\n\t\t\t<a href=\"/index.php?s=/Home/Help/apiGuide/tag/9.html#false_num\">错误代码对照表</a> \r\n\t\t</li>\r\n\t</ul>\r\n</li>\r\n\t</ol>\r\n<div id=\"user_instruction\" style=\"color:#333333;font-family:\" font-size:14px;background-color:#ffffff;\"=\"\">\r\n\t<div class=\"small_title\" style=\"font-size:18px;margin-left:20px;font-weight:bold;color:#555555;\">\r\n\t\t<p style=\"margin-left:20px;\">\r\n\t\t\tAPI使用说明(内容)\r\n\t\t</p>\r\n\t</div>\r\n\t<ol>\r\n\t\t<li id=\"request_info\" style=\"text-align:justify;color:#666666;margin-left:15px;\">\r\n\t\t\t<p style=\"font-size:16px;font-weight:bold;\">\r\n\t\t\t\t请求过程说明\r\n\t\t\t</p>\r\n\t\t\t<ol>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t构造请求数据，用户数据按照Jubi提供的接口规则，通过程序生成签名和要传输给Jubi的数据集合；\r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t发送请求数据，把构造完成的数据集合通过POST/GET提交的方式传递给Jubi；\r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\tJubi对请求数据进行处理，服务器在接收到请求后，会首先进行安全校验，验证通过后便会处理该次发送过来的请求；\r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t返回响应结果数据，Jubi把响应结果以JSON的格式反馈给用户，具体的响应格式，错误代码参见接口部分；\r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t对获取的返回结果数据进行处理；\r\n\t\t\t\t</li>\r\n\t\t\t</ol>\r\n\t\t</li>\r\n\t\t<li id=\"safe_ident\" style=\"text-align:justify;color:#666666;margin-left:15px;\">\r\n\t\t\t<p style=\"font-size:16px;font-weight:bold;\">\r\n\t\t\t\t安全认证\r\n\t\t\t</p>\r\n\t\t\t<ol>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<p style=\"font-size:15px;font-weight:bold;\">\r\n\t\t\t\t\t\t关于认证\r\n\t\t\t\t\t</p>\r\n\t\t\t\t\t<div>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\t所有的private API都需要经过认证\r\n\t\t\t\t\t\t</p>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\tApi的申请可以到财务中心 -&gt; API，申请得到私钥和公钥，私钥Jubi将不做储存，一旦丢失将无法找回\r\n\t\t\t\t\t\t</p>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\t注意:请勿向任何人泄露这两个参数，这像您的密码一样重要\r\n\t\t\t\t\t\t</p>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t</li>\r\n\t\t\t\t<li style=\"text-align:justify;\">\r\n\t\t\t\t\t<p style=\"font-size:15px;font-weight:bold;\">\r\n\t\t\t\t\t\t签名机制\r\n\t\t\t\t\t</p>\r\n\t\t\t\t\t<div>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\t每次请求private api 都需要验证签名，发送的参数示例：\r\n\t\t\t\t\t\t</p>\r\n<pre>$param = array(\r\n        amount =&gt; 1,\r\n        price =&gt; 10000,\r\n        type =&gt; \'buy\',\r\n        nonce =&gt; 141377098123\r\n        key =&gt; 5zi7w-4mnes-swmc4-egg9b-f2iqw-396z4-g541b\r\n        signature =&gt; 459c69d25c496765191582d9611028b9974830e9dfafd762854669809290ed82\r\n        );\r\n\r\n                                                  </pre>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\tnonce 可以理解为一个递增的整数：http://zh.wikipedia.org/wiki/Nonce\r\n\t\t\t\t\t\t</p>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\tkey 是申请到的公钥\r\n\t\t\t\t\t\t</p>\r\n\t\t\t\t\t\t<p>\r\n\t\t\t\t\t\t\tsignature是签名，是将amount price type nonce key等参数通过\'&amp;\'字符连接起来通过md5(私钥)为key进行sha256算法加密得到的值.\r\n\t\t\t\t\t\t</p>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t</li>\r\n\t\t\t</ol>\r\n\t\t</li>\r\n\t\t<li id=\"interface_api\" style=\"text-align:justify;color:#666666;margin-left:15px;\">\r\n\t\t\t<p style=\"font-size:16px;font-weight:bold;\">\r\n\t\t\t\t接口\r\n\t\t\t</p>\r\n\t\t\t<ol>\r\n\t\t\t\t<li id=\"interF_1\" style=\"text-align:justify;\">\r\n\t\t\t\t\t<p style=\"font-size:15px;font-weight:bold;\">\r\n\t\t\t\t\t\t获取当前最新行情 - Ticker\r\n\t\t\t\t\t</p>\r\nPath：/api/v1/ticker/Request类型：GET参数：coin - 币种简称,例如btc、ltc、xas返回JSON dictionary：high - 最高价high - 最高价high - 最高价high - 最高价high - 最高价high - 最高价返回结果示例：：\r\n<pre>{\"high\":22,\"low\":20,\"buy\":1.879,\"sell\":0,\"last\":38800,\"vol\":283.954},\r\n{\"high\":22,\"low\":20,\"buy\":1.879,\"sell\":0,\"last\":38800,\"vol\":283.954