:\" font-size:14px;background-color:#f7f7f7;\"=\"\">请退出当前登录，重新登录后使用新密码交易！</span>',1502358056,1510735167,1,1,'admin'),(237,0,19,'','修改交易密码','修改交易密码',1,1,'<div style=\"margin:0px;padding:0px;color:#222222;font-family:\" font-size:14px;background-color:#f7f7f7;\"=\"\">\r\n\t如果您不想使用现在的交易密码，可以修改一个新的交易密码。操作步骤登录平台账号在【安全中心】点击【修改交易密码】根据提示要求输入信息点击保存按钮即可！\r\n\t</div>',1502358160,1510735141,0,1,'admin'),(238,0,20,'','CMC交易区是什么意思','CMC交易区是什么意思',1,1,'<span style=\"color:#222222;font-family:\" font-size:14px;background-color:#f7f7f7;\"=\"\">CMC交易区是以<span style=\"color:#222222;\">CMC</span>为结算单位的交易区，人民币交易区是以人民币为结算单位的交易区。</span><span style=\"color:#222222;font-family:\" font-size:14px;background-color:#f7f7f7;\"=\"\"><span style=\"color:#222222;\">CMC</span>交易区的结算兑换是<span style=\"color:#222222;\">CMC</span>。</span><span style=\"color:#222222;font-family:\" font-size:14px;background-color:#f7f7f7;\"=\"\">拥有<span style=\"color:#222222;\">CMC</span>币可以在<span style=\"color:#222222;\">CMC</span>交易区购买其他资产，交易模式和人民币交易相同，不同的一点是，<span style=\"color:#222222;\">CMC</span>交易区卖出成功后，得到的不是人民币，而是<span style=\"color:#222222;\">CMC</span>币，如需提现，需在人民币交易区卖出，成功后申请人民币提现。</span>',1502358216,1510882123,1,1,'admin'),(239,0,20,'','交易手续费','交易手续费',1,1,'您好，交易手续费（AAT币0.15%）普通提现手续费0.5％， 快速提现手续费1%，每笔提现最低收费2元。单笔最小交易数量不能低于10元人民币哦。',1502358261,1510735101,0,1,'admin'),(250,84,3,'','美利奴羊巨雕感怀','美利奴羊巨雕感怀',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\">\r\n<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">\r\n\t羊是澳大利亚的国宝，尤其是美利奴羊，几乎无处不在，和自然浑成一体，与国家的发展密不可分。澳大利亚土地广袤，气候宜人，水草丰茂，美利奴羊在这里不断繁育、改良和生长，创造出了澳大利亚的一大支柱产业。我到澳大利亚后，耳闻目睹得多了，逐渐领悟到了“骑在羊背上的国家”的真正含义。\r\n</p>\r\n<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">\r\n\t为了了解美利奴羊，我专程从悉尼前往190公里外的古尔本，那里有肥沃的牧场，以独特的牧羊业传统而闻名。尤其是盛产美利奴羊，因而也是闻名的羊毛制品之地。当地有一个著名的旅游景点：大美利奴羊巨型雕塑。\r\n</p>\r\n<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">\r\n\t我辗转3小时，到了古尔本火车站。随后叫了一辆出租车，行驶10分钟后就到了休姆公路交叉口，透过车窗一眼就看到一个庞然大物。嘿，好大的一只美利奴羊！\r\n</p>\r\n<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">\r\n\t这家伙的确大。据资料介绍，它高15米，长18米，重96吨，是用混凝土雕塑而成。形态上看，它是灰白颜色，有两个弯弯带尖的羊角，颈部有3个横皱褶，是一只体大结实的美利奴羊。其英文名字叫得简单明了——“Big Morino”，意即“大美利奴”。蓝天白云之下，这只大美利奴羊耸然而立，既威风凛凛，又温柔祥和，似乎在告诉人们：澳大利亚是大美利奴羊最佳生存之地，也是大有作为之地。\r\n</p>\r\n<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">\r\n\t欣赏完巨雕，我走进侧面的3间白色建筑，这里便是工艺品店。店中一间摆放着各种图片和模型，介绍了巨雕的建设和搬运情况。另两间则专门出售美利奴羊的工艺品和美利奴羊的羊皮和羊毛制品。真是“不看不知道，一看吓一跳”。且不说店内摆设的美利奴羊工艺品多姿多彩，单是那两幅“百羊图”和“欢快的美利奴羊”，就让人过目难忘。美利奴羊的皮制品和毛纺织品，也让人看得眼花缭乱。什么羊皮褥子、羊皮垫子、羊皮衣，还有羊毛围巾、羊皮鞋等等。我拿起一块精制的羊皮，细细看来，其毛密柔软，洁白如雪，光泽耀眼。我正在欣赏工艺品之时，女店主人走了过来。她热情地告诉我，可以随意尽情拍照，她还从柜台上拿来一件美利奴羊工艺品，让我抱着，她给我拍照。店主人的热情深深地打动了我。接着，我们聊了起来，她向我介绍了澳大利亚美利奴羊的生产情况。她说，美利奴羊不仅产毛多，而且毛的质量好，毛纤维长，光泽度高，质地松软。一只成年的美利奴羊体重在140公斤左右，羊毛纤细柔软，粗约20微米，长约10厘米，是上乘的毛纺原料，每只羊一次可产毛10至20公斤。澳大利亚的美利奴羊毛产量占世界羊毛总产量的32％，其中95％供出口，每年收入20亿美元。澳毛可满足全世界羊毛需求的45％。她还向我介绍了美利奴羊羊毛质量和生产过程，使我获益甚多。\r\n</p>\r\n<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">\r\n\t辞别女店主人，走出工艺品店，回眸昂首向上的“大美利奴”巨雕，那逗人的姿态，童话般的形象，给人以祥和吉庆之感，深深留在我美好的记忆之中。\r\n</p>\r\n\t</p>\r\n<span style=\"color:#333333;font-family:\" font-size:14px;background-color:#ffffff;\"=\"\"></span>',1503470360,1510654289,0,1,'星币网'),(251,83,3,'','乌珠穆沁羊究竟有多伟大？','乌珠穆沁羊究竟有多伟大？',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<h2 id=\"titiletext\" style=\"font-family:simhei;font-size:30px;background-color:#FFFFFF;\">\r\n\t\t\t<strong>乌珠穆沁羊究竟有多伟大？</strong> \r\n\t\t</h2>\r\n\t</div>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n</p>',1503470405,1510654239,0,1,'星币网'),(252,84,3,'','最好的细毛羊品种——澳洲美利奴羊','最好的细毛羊品种——澳洲美利奴羊',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<b> <p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t澳洲美利奴羊产于澳大利亚。从1797年开始，由英国及南非引进的西班牙美利奴、德国萨克逊美利奴、法国和美国的兰布列品种杂交育成，是世界上最著名的细毛羊品种。我国于1972年以后开始引入澳洲美利奴羊，对提高和改进我国的细毛羊品质有显著效果，并以此为主要素材之一培育出了中国美利奴羊。澳洲美利奴羊多作为提高我国细毛羊品种的被毛质量和净毛率而改良杂交的父本。\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t澳洲美利奴羊具有毛丛结构好、羊毛长而明显弯曲、油汗洁白、光泽好、净毛率高、毛密度大、细度均匀的特点，对各种环境气候有很强的适应性。体型近似长方形，腿短、体宽、背部平直，后躯肌肉丰满；公羊颈部由1～3个发育完全或不完全的横皱褶，母羊有发达的纵皱褶。羊毛覆盖头部至两眼连线，前肢达腕关节，后肢达飞节。\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t在澳大利亚，美利奴羊被分为三种类型，它们是超细型和细毛型(Super Fine amp; Fine Merino)，中毛型(Medium Wool Merino)及强毛型 (StrongWoolMerino)。其中又分为有角系与无角系两种。无角是由隐性基因控制的，通过选择无角公羊与母羊交配而培育出美利奴羊无角系。细毛型成年羊体重公羊为60～70千克，母羊为38～42千克；剪毛量公羊为7．5～8．5千克，母羊为4～5千克，羊毛细度64/70～80支，毛长7～10厘米，净毛率63%～68%，纤维数6．2～9．3千/平方厘米；中毛型成年羊体重公羊为65～90千克，母羊为40～44千克；剪毛量公羊为8～12千克，母羊为5～6千克，羊毛细度60～64支，毛长7～13厘米，净毛率62%～65%，纤维数5．4～9．3千／平方厘米；强毛型成年羊体重公羊为70～100千克，母羊为42～48千克；剪毛量公羊为8．5～14千克，母羊为5～6．5千克，羊毛细度58～60支，毛长9～13厘米，净毛率60%～65%，纤维数4．6～7．7千／平方厘米。\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_2.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_3.gif\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_4.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_5.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_6.bmp\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_7.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_8.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_9.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://photocdn.sohu.com/20150324/mp7669485_1427180237674_10.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n</b> \r\n\t</div>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n</p>',1503470475,1510654214,0,1,'星币网'),(253,83,3,'','叮咚！您有一只来自锡林郭勒大草原放养的乌珠穆沁羊到了','叮咚！您有一只来自锡林郭勒大草原放养的乌珠穆沁羊到了',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCb4Vpg52\" target=\"_blank\"><img src=\"http://s3.sinaimg.cn/mw690/004hlKXSzy75kCb4Vpg52\" alt=\"\" title=\"\" /></a><a>&nbsp;</a> \r\n\t</div>\r\n\t\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp;<strong>“乌珠穆沁羊”</strong>产于内蒙古锡林郭勒盟东部乌珠穆沁草原，主要分布在东乌珠穆沁旗、西乌珠穆沁旗等地区，产量总数已超过100万只。乌珠穆沁羊系蒙古羊在当地条件下，经过长期选育形成的一个优良类群，1982年经国家农业部、国家标准总局的确认下，正式批准“乌珠穆沁羊”为当地优良品种。\r\n\t\t\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t\t\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCdi78R41\" target=\"_blank\"><img src=\"http://s2.sinaimg.cn/mw690/004hlKXSzy75kCdi78R41\" alt=\"\" title=\"\" /></a> \r\n\t\t\t</div>\r\n\t\t\t\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp; 内蒙古乌珠穆沁地区，素有“天堂草原”之称，乌珠穆沁肥尾羊“吃着中草药、喝着矿泉水”生长，其肉品质优良，营养丰富，纯绿色无污染，深受国内外消费者喜爱，被誉为“天下第一羊”。2000年乌珠穆沁羊肉被列为内蒙古自治区名牌农畜产品，2008年成为北京奥运会供奥产品，2010年成为上海世博会供沪产品。目前，乌珠穆沁肉羊系列产品畅销北京、上海、天津、东北、呼和浩特等大中城市，乌珠穆沁活羊、冰鲜羊肉远销沙特、约旦、科威特等中东国家！\r\n\t\t\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"> <strong>乌珠穆沁羊 - 外形特征</strong> \r\n\t\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; 乌珠穆沁羊属肉脂兼用短尾粗毛羊，以体大、尾大、肉脂多、羔羊生产发育快而著称。乌珠穆沁羊是在当地特定的自然气候和生产方式下，经过长期的自然和人工选择而逐渐育成的。\r\n\t\t\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; 乌珠穆沁羊体质结实，体格大。头中等大小，额稍宽，鼻梁微隆起。公羊大多无角，少数有角，母羊多无角。胸宽深，肋骨开张良好，胸深接近体高的1/2，背腰宽平，后躯发育良好。肌肉丰满，结构匀称。四肢粗壮，有小脂尾。毛色以黑头羊居多，约占6.2%，全身白色者约占10%，体躯花色者约11%。\r\n\t\t\t\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t\t\t\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t\t\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCgvoena3\" target=\"_blank\"><img src=\"http://s4.sinaimg.cn/mw690/004hlKXSzy75kCgvoena3\" alt=\"\" title=\"\" /></a> \r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"> <strong>乌珠穆沁羊 - 生产性能</strong> \r\n\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; 乌珠穆沁羊的饲养管理极为粗放，终年放牧，不补饲，只是在雪大不能放牧时稍加补草补料。乌珠穆沁羊生长发育较快，2.5～3月龄公、母羔羊平均体重为29.5和24.9公斤；6个月龄的公、母羔平均达40和36公斤，成年公羊60～70公斤，成年母羊56～62公斤，平均胴体重17.90公斤，屠宰率50%，平均净肉重11.80公斤，净肉率为33%；乌珠穆沁羊肉水份含量低，富含钙、铁、磷等矿物质，肌原纤维和肌纤维间脂肪沉淀充分。产羔率仅为100%。\r\n\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp;乌珠穆沁羊适于终年放牧饲养，具有增膘快、蓄积脂肪能力强、产肉率高、性成熟早等特性，适于利用牧草生长旺期，开展放牧育肥或有计划的肥羔生产。同时，乌珠穆沁羊也是做纯种繁育胚胎移植的良好受体羊，后代羔羊体质结实抗病能力强，适应性较好。\r\n\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"><br />\r\n\t\t\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t\t\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCiAMTR07\" target=\"_blank\"><img src=\"http://s8.sinaimg.cn/mw690/004hlKXSzy75kCiAMTR07\" alt=\"\" title=\"\" /></a> \r\n\t\t\t</div>\r\n\t\t\t\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"> <strong>乌珠穆沁羊 - 产地及环境</strong> \r\n\t\t\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp;乌珠穆沁羊产于内蒙古自治区锡林郭勒盟东部的乌珠穆沁草原。产区处于蒙古高原大兴安岭西麓，属大陆性气候，海拔为800～1200米，气候较寒冷，年平均气温为0～1.4℃。\r\n\t\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp;乌珠穆沁草原1月份平均气温为-21℃（最低-40℃）；7月份平均气温为20℃（最高39℃），年降水量为250～300毫米，无霜期为90～120天。每年10月中下旬开始积雪，厚度为8～9厘米，到翌年4月底才能化尽。\r\n\t\t\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp;青草期短，枯草期长。牧草以线叶菊、冷蒿、羊草、大针茅、隐子草、早熟禾、苔草为主。另外还有直立黄芪、莎草和杂草。草层高度为20～30厘米。产区地广人稀，羊群大多以每群1200～1500只组群，管理粗放，终年依靠天然草场游牧，冬春季不补草料。\r\n\t\t\t\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t\t\t\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t\t\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCkY4o000\" target=\"_blank\"><img src=\"http://s1.sinaimg.cn/mw690/004hlKXSzy75kCkY4o000\" alt=\"\" title=\"\" /></a> \r\n\t\t\t\t</div>\r\n\t\t\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"> <strong>乌珠穆沁羊 - 品种性能</strong> \r\n\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; 乌珠穆沁羊成年公羊平均体高、体长、胸围和体重分别为：71.1±3.52厘米，77.4±2.93厘米，102.9±4.29厘米，74.43±7.15公斤，成年母羊分别为：65.0±3.10厘米，69.7±3.79厘米，93.4±5.75厘米，58.40±7.76公斤。\r\n\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"> <strong>&nbsp; &nbsp; 乌珠穆沁羊</strong>一年剪毛两次，春季剪毛量，成年公羊平均为1.9公斤，成年母羊平均1.4公斤。毛被属异质毛，由绒毛、两型毛、粗毛及死毛组成。乌珠穆沁羊的毛皮可用作制裘，以当年羊产的毛皮质佳。其毛皮毛股柔软，具有螺旋形环状卷曲。\r\n\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp;初生和幼龄羔羊的毛皮，也是制裘的好原料。乌珠穆沁羊游走采食，抓膘能力强，大群放牧日可行15～20公里,边走边吃。雪天羊只善于扒雪吃草。\r\n\t\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t乌珠穆沁羊不但具有适应性强、适于天然草场四季大群放牧饲养、肉脂产量高的特点，而且具有生长发育快、成熟早、肉质细嫩等优点，是一个有发展前途的肉脂兼用粗毛羊品种，适用于肥羔生产。\r\n\t\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCo8R0je7\" target=\"_blank\"><img src=\"http://s8.sinaimg.cn/mw690/004hlKXSzy75kCo8R0je7\" alt=\"\" title=\"\" /></a> \r\n\t\t</div>\r\n\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\"> <strong>乌珠穆沁羊 - 走出国门</strong> \r\n</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp;中东穆斯林地区作为世界上最大的活羊进口市场，每年的消费量约2000万只，而羊肉的供应则主要依靠进口。该地区是以食羊肉为主，其因缘于穆斯林民族在饮食起居中的卫生观念和禁忌习惯，伊斯兰世界有三大传统盛大节日——宰牲节(亦称古尔邦节)、开斋节、圣纪日。除日常食用，在宰牲节、圣纪日(穆罕默德诞辰日)都需要宰杀大量的活羊。在《古兰经》里，记载着这样一个故事：\r\n\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp; 有一夜，先知伊卜拉欣做了一个梦，梦见真主命他将儿子易司马仪杀掉供献祭。伊卜拉欣决心服从真主的意志，举刀向儿子砍去，但却砍不动。伊卜拉欣向真主问求。真主从天国里送来一只绵羊，伊仆拉欣拿刀宰了羊，这头羊就是易司马仪的替身。穆斯林为了纪念这件事，每年都在这天宰牲献祭。因而在过宰牲节时，凡有条件和能力的穆斯林家庭都要买来活芋宰杀?即使买不起活羊的穷人家也得想办法弄点儿肉来打打“牙祭”。这也就是每逢宰牲节穆斯林都有宰杀羊的习俗。乌珠穆沁羊是在锡林郭勒草原—特定的自然气候和生产方式下，经过长期的自然和人工选择而逐渐育成的。具有丰富的营养成分，富含钙、铁、磷等矿物质，肉质鲜嫩，不膻不腻，是天然绿色食品；颇受中东皇室贵族的青睐，曾经是沙特皇室的特供品。\r\n</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCpYpPp47\" target=\"_blank\"><img src=\"http://s8.sinaimg.cn/mw690/004hlKXSzy75kCpYpPp47\" alt=\"\" title=\"\" /></a> \r\n</div>\r\n\t</div>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t从1983年起，我盟开始向中东地区出口活羊，以海运为主，秦皇岛港口交货。累计出口乌珠穆沁羊116万只，创汇5800万美元。巨大的商机，高额的效益导致了恶性竞争，使我国活羊出口企业效益直线萎缩。1996年起中国的活羊出口被迫退出中东市场，我盟的活羊出口也是自那时起中断。 　　 &nbsp;\r\n\t\t</p>\r\n<p style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t&nbsp; &nbsp; &nbsp; 但国家及自治区十分重视恢复和开拓我盟对中东地区活羊出口及羊肉制品市场，多次派考察组深入锡盟进行实地调研。最后决定决定投入1000万元支持锡盟活羊出口基地建设，以尽快实现活羊出口创汇。至此在国家、自治区大力支持下，在我盟为恢复活羊出口所做大量工作下，中断多年的活羊出口在2004年9月20日，首批4．5万只乌珠穆沁羊从锡林郭勒草原装车运往秦皇岛装船，使活羊出口贸易得以重新恢复。\r\n\t</p>\r\n<div style=\"color:#333333;font-family:\" font-size:17px;\"=\"\">\r\n\t<div style=\"text-align:center;padding:0px 0px 34px;\">\r\n\t\t<a href=\"http://photo.blog.sina.com.cn/showpic.html#blogid=&url=http://album.sina.com.cn/pic/004hlKXSzy75kCrERVzf5\" target=\"_blank\"><img src=\"http://s6.sinaimg.cn/mw690/004hlKXSzy75kCrERVzf5\" alt=\"\" title=\"\" /></a> \r\n\t</div>\r\n\t<div>\r\n\t\t<br />\r\n\t</div>\r\n</div>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n\t</p>',1503470546,1510653759,0,1,'星币网'),(254,83,3,'','不是所有的羊肉都叫乌珠穆沁羊肉','不是所有的羊肉都叫乌珠穆沁羊肉',0,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t说到乌珠穆沁羊，对他最牛逼的描述就是“天下第一羊”了，都天下第一了，那这这个羊肉肯定是好吃的不得了！\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/62bbeac9129f4f0ab1df6ebb28f1a4a9.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t主要分布在要分布在东乌珠穆沁旗和西乌珠穆沁旗，以及毗邻的锡林浩特市、阿巴嗄旗部分地区，素有“天堂草原”之称。\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/ec42d1bc766d4fdca667f2b34953348c.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/7f8dfd06fd6943849df624d2993aa7d9.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t乌珠穆沁肥尾羊“吃着中草药、喝着矿泉水”生长，其肉品质优良，营养丰富，纯绿色无污染，深受国内外消费者喜爱。\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/1d39e3ed1cae4635bf54fbe8c9fce82d.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t乌珠穆沁肥尾羊，肉质鲜嫩、色泽鲜美，富含人体所需的多种氨基酸，被誉为“肉中人参”\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t这只羊的荣誉有这些\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t内蒙古自治区名牌农畜产品\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>国家级畜禽资源保护品种</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>国家地理标志产品</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t北京奥运会供奥产品\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t上海世博会供沪产品\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t哇！好多好大的荣誉哦！\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t其实，对于肉来说，他只要好吃，就会得到认可，那么乌珠穆沁的羊为什么好吃啊！\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>最重要的两点就是！</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t理由\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>乌珠穆沁羊</span>每天一个半马！\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t每只羊每天行走20公里以上\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/9a6d9ff04b864344afb3ffe47116ad7f.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/7bb24a866e1f425482485d4fa77f82d5.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/8ed0dca2c35747ff8eb96081eecf9eff.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t自然呢这个身材就棒棒哒\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>就好像下图右边那样</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>不吃瘦肉精，</span><span>依然瘦肉满满</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/ef40e939f8704f0db9f17f9ccab9485b.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t那么左边这个就是一出门就吃饱\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t每天也不怎么锻炼身体\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t吃着瘦肉精，<span>在垃圾食品中成长的育肥羊</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t告诉我\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t你是不是更喜欢那个肌肉的哈\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/939abcc2e23f4ea1b527a0cdca6cc472.gif\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t对，YES\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t这就是我们乌珠穆沁的羊肉\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>肉质厚实又紧凑</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/054a2cb800714b25bc75d2963c8c3b3a.jpeg\" style=\"height:auto;\" /> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t理由\r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t2\r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span><span>乌珠穆沁</span>羊每天都吃天然无污染的牧草</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>吃绿色食品当然身体素质好</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>牧草中最多的两种名贵的牧草</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>沙葱和野韭菜</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <img width=\"auto\" src=\"http://5b0988e595225.cdn.sohucs.com/images/20170919/cc62e47e5e2c4ce2a4a047f26770450f.jpeg\" style=\"height:auto;\" /> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>4--9月草原上长满了野韭菜和沙葱</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>吃着沙葱和野韭菜长大的羊</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>羊肉肥瘦均可口感极佳</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>入口细腻而不腻，</span><span>羊膻味小</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>又到了羔羊出栏的季节了</span> \r\n\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\"> <span>准备好你的味蕾</span> \r\n\t\t\t</p>\r\n<p style=\"font-size:16px;color:#191919;font-family:\" background-color:#ffffff;\"=\"\">\r\n\t\t\t品味<span>乌珠穆沁</span>羊肉\r\n\t\t</p>\r\n\t</div>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n</p>',1503470617,1510653734,0,1,''),(255,82,4,'','为什么只有呼伦贝尔的羊才可以称为贵族羊','为什么只有呼伦贝尔的羊才可以称为贵族羊',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">为一个贵族，不但有优良的血统，更有专属的特权，在行为举止、饮食习惯、作息等生活方式上都有非常严格的标准。如果要以这样的标准来评判一只羊，那只有呼伦贝尔羊才能获此殊荣。究竟这呼伦贝尔贵族羊和平民羊的区别究竟有多大，且听我给您说道说道。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"500\" height=\"293\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=37c47393b3014a90813e46b599763971/2b05df5c10385343d2214b009913b07ecb8088d0.jpg\" /><br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">说起哪的羊好吃，每个人都会说自己家乡的羊是最好的，不但肉味醇美、没有膻味，还能从羊肉里面品尝到家乡的味道。其实评判一只羊的好坏没有一个固定的标准，但我们可以从这只羊的生活方式来做出客观的评判。</span><br />\r\n<img class=\"BDE_Image\" width=\"500\" height=\"293\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=f69df2eb5b3d26972ed3085565fbb24f/d0348416fdfaaf51a5af4e9e865494eef01f7a76.jpg\" /><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">专属呼伦贝尔贵族羊的特权</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">呼伦贝尔大草原，是世界著名的高原牧场，不但有优质的牧草，更有众多的野生药用植物供呼伦贝尔羊食用，这些都是在其他地方的平民羊不能享受的待遇。</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">另外，呼伦贝尔大草原得名于胡伦湖以及贝尔湖，既然有这样的湖泊，就说明呼伦贝尔草原水资源极为丰富，而呼伦贝尔羊就是喝着这些“高端矿泉水”成长起来的。这一方水土养育了最尊贵的呼伦贝尔羊。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"500\" height=\"293\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=c45f5afd02fa513d51aa6cd60d6c554c/b9c0d71b9d16fdfafa8109cfbe8f8c5495ee7bd5.jpg\" /><br />\r\n<br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">贵族羊吃的草有370余种</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">这个数字没有任何夸张的成为，在呼伦贝尔大草原上，有包括羊草、无芒雀麦、宽穗雀麦、偃麦草、野大麦、天蓝苜蓿等370多个品种。不但贵族羊的饮食口味如此多元化，在牧草品质方面也堪称顶级，就是因为呼伦贝尔大草原是一片没有任何污染的绿色净土，这里是中国保存最完好的草原，有“牧草王国”的美称。</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">从另外一个角度说，这里连牧草都可以出口给国外，可想而知我们的贵族羊在吃的方面品质有多高了吧。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"560\" height=\"328\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=19fcebcea3ec8a13141a57e8c7029157/51edcc628535e5dda9c16afe7cc6a7efcf1b62d5.jpg\" /><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">贵族羊的“零食”也令人惊讶</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">广阔的草原，不但有丰富的牧草资源，还有200余种野生药物植物以及数量众多的人类可食用的植物以及野果。这些可都是我们的呼伦贝尔贵族羊日常零食之一。</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">草原白蘑、木耳、野韭菜、山葱、山杏、山刺梅等野生植物，对于我们来说能有幸品尝一次都让我们回味无穷。但对于它们的主人贵族羊来说，这些真的就是他们日常的零食。这些高品质的野生药物、野果等，不但给贵族羊提供更加丰富的营养，还能让我们在食用的时候享受独特的口感以及一定的药用价值。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"560\" height=\"328\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=5e0f53fd8013632715edc23ba18ea056/cb4d9c35e5dde711df3f8cd7adefce1b9c1661d5.jpg\" /><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">贵族羊喝的水都是纯天然无污染的</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">呼伦贝尔大草原有嫩江水系和额尔古纳河水系、3000多条纵横交错的河流、500多个星罗密布的湖泊，没有任何工业污染的水源就是贵族羊的饮用水。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"560\" height=\"328\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=f93c7002692762d0803ea4b790ed0849/9b1afcdde71190ef26165dfec41b9d16fcfa60d5.jpg\" /><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">贵族羊身体素质好</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">呼伦贝尔羊是在大兴安岭以西呼伦贝尔草原特定的生态条件及无霜期短，枯草期长，冬季漫长的严寒气候环境中，终年放牧条件下选育而形成。对粗放和恶劣的环境条件抗逆性强，发病率低。在1984年、1988年的牧区特大雪灾中，细毛羊及改良羊的死亡率局部达到50—60%，而呼伦贝尔羊的死亡率在15%以下。呼伦贝尔羊能够在覆盖20多厘米的雪地里长时间刨雪吃草、维持生命。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"500\" height=\"293\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=b787efdf3cd3d539c13d0fcb0a87e927/8925294e251f95caafa55d97c3177f3e6709526a.jpg\" /><br />\r\n<br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">贵族羊营养价值高</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">呼伦贝尔羊，肉无膻味，肉质鲜美，营养丰富。据内蒙古农牧业渔业生物实验研究中心检验，呼伦贝尔羊肉化学成份中，脂肪酸的不饱和程度低，脂肪品质好。肌肉的脂肪酸主要由豆蔻酸、软脂酸、硬脂酸，油酸和亚麻酸组成，占91.5%。各种氨基酸含量较高，特别是谷氨酸和天门冬氨酸的相对含量比其它羊肉高，使呼伦贝尔羊肉鲜美可口，味道特别好。</span><br />\r\n<br />\r\n<img class=\"BDE_Image\" width=\"560\" height=\"385\" src=\"http://imgsrc.baidu.com/forum/w%3D580/sign=dbc3993668d0f703e6b295d438fb5148/fbf2fe1190ef76c6f63f340a9716fdfaae5167d5.jpg\" />\r\n\t</div>\r\n\t<div>\r\n\t\t<br />\r\n\t</div>',1503470734,1510655039,0,1,'星币网'),(256,82,4,'','内蒙自治区家畜改良站对我市 呼伦贝尔细毛羊进行调研','内蒙自治区家畜改良站对我市 呼伦贝尔细毛羊进行调研',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<p style=\"font-size:14px;font-family:verdana;background-color:#FFFFFF;\">\r\n\t\t\t为了切实保护和利用呼伦贝尔细毛羊优质资源。日前，内蒙古自治家畜改良工作站育种科科长包呼格、副科长刑玉梅一行对我市呼伦贝尔细毛羊生产现状、繁育体系建设情况及存在问题建议等进行调研。呼伦贝尔市畜牧工作站副站长王玉、扎兰屯市畜牧工作站站长丁伟良全程陪同。\r\n\t\t</p>\r\n\t\t<p style=\"font-size:14px;font-family:verdana;background-color:#FFFFFF;\">\r\n\t\t\t调研组对成吉思汗牧场、大河湾镇养殖户进行实地调研。详细查看羊群营养状况、个体大小、羊毛密度、毛纤维细度、毛纤维长度、油汗弯曲以及毛纤维有无饥饿痕、毛丛是否存在两型毛、遗传资源是否纯正，全面了解了我市呼伦贝尔细毛羊的遗传资源及其生产性能等情况。\r\n\t\t</p>\r\n\t\t<p style=\"font-size:14px;font-family:verdana;background-color:#FFFFFF;\">\r\n\t\t\t调研后，包呼格表示，扎兰屯市是呼伦贝尔细毛羊主要育种基地之一，育种核心群就设在扎兰屯市境内成吉思汗牧场，呼伦贝尔细毛羊养殖基础很好，尽管近些年有小尾寒羊等其它血统引进，但呼伦贝尔细毛羊的保种、育种工作做的不错，一部分品质优良的呼伦贝尔细毛羊被保留下来了，下一步可以在细毛羊的提纯、提高上做做文章。\r\n\t\t</p>\r\n\t</div>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n</p>',1503470789,1510654948,0,1,'星币网'),(257,84,4,'','羊毛研究所新发现，这只羊有可能活了1000年','羊毛研究所新发现，这只羊有可能活了1000年',1,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<p class=\"news-summery\" style=\"font-family:&quot;font-size:16px;color:#666666;text-indent:2em;\">\r\n\t\t\t<strong>[摘要]</strong>&nbsp;而北方大地也眼看着将要落大雪了，你的汽车内部保暖工作准备好了吗？ 小编友情提示： 薅羊毛最好的时机到了！打开手淘，搜索框内输入“薅羊毛”，即可薅到货真价实的羊毛哦！没玩够或没玩过的车友们，赶紧去手淘搜索“薅羊毛”吧，或许还能赶上双十一前最后一次福利末班车噢！ 俗话说，羊毛出在羊身上。\r\n\t\t</p>\r\n\t\t<div class=\"dbk clears\" style=\"font-family:&quot;margin:0px;padding:0px;border:0px;color:#333333;\">\r\n\t\t</div>\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">017年双十一已进入倒计时了，各大商家优惠促销正进行得如火如荼。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;而北方大地也眼看着将要落大雪了，你的汽车内部保暖工作准备好了吗？</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;小编友情提示：</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;薅羊毛最好的时机到了！打开手淘，搜索框内输入“薅羊毛”，即可薅到货真价实的羊毛哦！没玩够或没玩过的车友们，赶紧去手淘搜索“薅羊毛”吧，或许还能赶上双十一前最后一次福利末班车噢！</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;俗话说，羊毛出在羊身上。你吃过的羊肉、羊杂；你用过的羊毛被、穿过的羊毛衫；甚至你现在准备“薅羊毛”！</span>\r\n\t\t<div style=\"font-family:&quot;margin:0px;padding:0px;border:0px;background-color:#FFFFFF;text-align:center;font-size:16px;\">\r\n\t\t\t<img alt=\"\" src=\"http://www.donews.cn.com/uploads/allimg/171101/4-1G101115610.png\" />\r\n\t\t</div>\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;这次，我们邀请了来自澳洲羊毛研究所的羊博士为我们解锁传说中活了千年的羊精美利奴羊及薅羊毛中羊毛的真实来历。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;为什么是美利奴羊毛？</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;美利奴绵羊（Merino）又名美丽诺羊，产于有着“骑在羊背上的国家”之美称的澳大利亚，那里气候温和，既没酷热，也没有严寒，拥有辽阔的天然草原，极其适合美利奴羊生存，得天独厚的环境优势造就了美利奴羊毛的绝佳品质。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp;</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;美利奴羊毛直径约23-24.5微米，毛丝长度可达4-10厘米，是世界上最细的羊毛之一。 &nbsp;&nbsp;&nbsp;</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;自1797年澳大利亚从西班牙引进良种的美利奴绵羊开始，经过两百年的不断改良，才育成了这种独特的超细羊毛品种。事实证明，美丽诺羊离开澳洲就会产生品种变异。从而间接造成了美丽诺羊毛只能从澳洲进口，也是因为如此，美丽诺羊毛与袋鼠、考拉同等成为澳洲国宝级特产。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;美利奴羊毛坐垫的优势？</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;天然健康材质，更亲近舒适</span><span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\"></span>\r\n\t\t<div style=\"font-family:&quot;margin:0px;padding:0px;border:0px;background-color:#FFFFFF;font-size:16px;\">\r\n\t\t\t&nbsp; &nbsp; &nbsp; &nbsp;好的美利奴羊毛直径可达19.5微米以下，是羊毛品种中最细的。这样的羊毛制成的羊毛坐垫不但弹性好，而且手感十分柔软细腻，久坐也不会塌。再加上美利奴羊毛是天然纤维，舒适不过敏，特殊的纤维结构使得羊毛的保暖性和透气性极佳。\r\n\t\t</div>\r\n\t\t<div style=\"font-family:&quot;margin:0px;padding:0px;border:0px;background-color:#FFFFFF;text-align:center;font-size:16px;\">\r\n\t\t\t<img alt=\"\" src=\"http://www.donews.cn.com/uploads/allimg/171101/4-1G101115608.png\" />\r\n\t\t</div>\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp;</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;防潮保健，利于身体健康</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;美利奴羊毛内含丰富的角蛋白，能够有效防止细菌滋生，防止异味产生，毛的良好的保暖/透气/防潮性能对于关节炎和风湿病人具有很好的疗效，同时有利于改善皮肤的血液循环，增强抵抗皮肤病的能力。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp;</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;时尚有档次，品味温暖质感</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;羊皮毛鲜艳的图案和色泽，具有很强的装饰性。柔柔的质感，暖暖的色调，在展现时尚态度的冬季，给靓车配上一款高档的羊毛座垫，更会显得高档气派，让整个车舱暖意融融。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp;</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;羊毛坐垫哪家好，尼罗河是您的第一选择</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;尼罗河&amp;澳洲合作，拥有澳洲羊毛专属供货地</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;早在1990年，尼罗河就开始涉足羊毛款的汽车坐垫，之所以长久销量领先，多半是因为拥有澳洲这块羊毛专属供货地，毕竟看过前面文章的你也知道澳洲的羊毛是难得一见的高精细羊毛。</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;27年匠心工艺传承，大品牌品质保证</span><br />\r\n<span style=\"font-family:&quot;background-color:#FFFFFF;font-size:16px;line-height:30px;\">&nbsp; &nbsp; &nbsp; &nbsp;作为中国汽车坐垫十大品牌，尼罗河除了拥有专属的供货地——澳大利亚，还配备专属的设计工作室，对所有皮毛、布料及部件均用心挑选、雕琢，直至舒适性、耐久性，色彩及美感均超凡脱俗为止。产品远销美洲、欧洲、东南亚、非洲四大洲的30多个国家和地区，声誉显赫。</span>\r\n\t</div>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n</p>',1503470847,1510654794,0,1,'星币网'),(258,84,4,'','我国育成国家级细毛羊新品种“高山美利奴羊”','民警帮村民深夜找回丢失的羊',1,0,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><span style=\"color:#333333;font-family:\" font-size:14px;background-color:#ffffff;\"=\"\">近日，中国农业科学院兰州畜牧与兽药研究所杨博辉研究员为首席的创新团队联合甘肃省绵羊繁育技术推广站等7家单位，历经20载，培育出我国首例适应高山寒旱生态区的细型细毛羊新品种——高山美利奴羊，通过了国家畜禽遗传资源委员会新品种审定。该品种的培育成功，填补了世界高海拔生态区细型细毛羊育种的空白，是我国高山细毛羊培育的重大突破，达到国际领先水平。</span> \r\n\t</p>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><span style=\"color:#333333;font-family:\" font-size:14px;background-color:#ffffff;\"=\"\"><span style=\"color:#333333;font-family:\" font-size:14px;background-color:#ffffff;\"=\"\">　高山美利奴羊是以澳洲美利奴羊为父本甘肃高山细毛羊为母本，运用现代育种先进技术培育成功的新品种。该品种适应2400-4070米生态区，具有良好的抗逆性和生态差异化优势，羊毛细度达到19.1-21.5微米，性能指标和综合品质超过了同类型澳洲美利奴羊，实现了澳洲美利奴羊在我国高海拔、高山寒旱生态区的国产化，丰富了羊品种资源的结构。据预测，每年可推广种公羊1.6万只，改良细毛羊600万只，新增产值可达10亿元。对于对促进我国细毛羊产业升级，满足我国毛纺工业特别是高档羊毛的需求，提升国际竞争力，改善广大农牧民的生活生产，具有极其重要的经济价值、生态地位和社会意义。</span><br />\r\n</span> \r\n</p>\r\n<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"><br />\r\n\t</p>',1503470899,1510883208,0,1,'admin');
INSERT INTO `currency_text` VALUES (259,84,4,'','刘守仁：绵羊育种领域研究长达60年 他创造“中国美利奴”','刘守仁：绵羊育种领域研究长达60年 他创造“中国美利奴”',0,1,'<p style=\"font-size:14px;text-indent:2em;color:#333333;font-family:\" background-color:#ffffff;\"=\"\"> <b> </b> \r\n\t</p>\r\n\t<div class=\"zybjys\" style=\"margin:0px;padding:10px;background-color:#E8E8E8;font-size:16px;font-family:微软雅黑, 隶书, 新宋体, 黑体;color:#333333;\">\r\n\t\t<div class=\"timefun\" style=\"margin:7px 0px 0px;padding:0px;color:#838383;font-family:宋体, tahoma, arial, sans-serif;text-align:center;background-color:#FFFFFF;\">\r\n\t\t\t<span class=\"origin\" id=\"media_name\">来源：中国科技网-科技日报</span>&nbsp;<span class=\"author\" id=\"art_source\">作者：朱 彤</span>&nbsp;<span id=\"pub_date\">2015年06月06日　00:41</span> \r\n\t\t</div>\r\n\t\t<div class=\"clearboth\" style=\"margin:0px;padding:0px;font-family:宋体, tahoma, arial, sans-serif;text-align:center;background-color:#FFFFFF;\">\r\n\t\t</div>\r\n\t\t<div class=\"ddfun\" id=\"daodu\" style=\"margin:10px auto;padding:10px;background:#F3F3F3;font-size:14px;color:#838383;font-family:宋体, tahoma, arial, sans-serif;\">\r\n\t\t\t<b>[导读]</b>&nbsp;院史陈列馆科技成果展板上清晰地列着：《中国美利奴羊新品种的育成》获1987年国家科技进步一等奖，《中国美利奴（新疆军垦型）繁育体系》获1991年国家科技进步一等奖，《中国美利奴肉用、超细毛、多胎肉用羊的培育》2007年获国家科技进步二等奖。\r\n\t\t</div>\r\n\t\t<div class=\"clearboth\" style=\"margin:0px;padding:0px;font-family:宋体, tahoma, arial, sans-serif;text-align:center;background-color:#FFFFFF;\">\r\n\t\t</div>\r\n\t\t<div id=\"zhengwen\" class=\"area_body\" style=\"margin:30px 0px 0px;padding:0px;font-family:宋体, tahoma, arial, sans-serif;background-color:#FFFFFF;font-size:16px;\">\r\n\t\t\t<div class=\"TRS_Editor\" style=\"margin:0px auto;padding:0px;color:#3B3B3B;\">\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t原标题：刘守仁：他创造了“中国美利奴”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t本报记者&nbsp;&nbsp;朱&nbsp;彤\r\n\t\t\t\t</p>\r\n\t\t\t\t<p align=\"center\" style=\"text-indent:2em;\">\r\n\t\t\t\t\t<img alt=\"\" src=\"http://h.wokeji.com/kbjh/zxbd_10031/201506/W020150606250538451329.jpg\" /> \r\n\t\t\t\t</p>\r\n\t\t\t\t<p align=\"center\" style=\"text-indent:2em;\">\r\n\t\t\t\t\t&nbsp;刘守仁（中）查看绵羊生长情况。本报记者&nbsp;朱彤摄\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t新疆农垦科学院细毛羊育种一直走在全国前列，兵团最好的细毛羊在他手中。有人这样评价刘守仁。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t笑起来眼睛眯成一条缝，不时冒出几句带有江浙味儿的粗话。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t和蔼可亲，平易近人，幽默开朗。这是81岁的新疆农垦科学院名誉院长、中国工程院院士刘守仁给人的第一印象。猛然间觉得，他特像金庸笔下的“老顽童”周伯通，童心未泯。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“欢迎各位老师来采访。”语惊四座，好一句“老师”，如此谦虚，让我们这些儿孙辈采访者“羞愧难当”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“从21岁到81岁，都在和细毛羊打交道。闻惯了羊圈味儿，听惯了羊叫声，几天不去看看我的羊，心里就‘痒痒’。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t谈他自己，寥寥几句；谈起细毛羊，滔滔不绝，眉开眼笑。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t<strong>岂敢小瞧我“羊圈”里的羊</strong> \r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t新疆农垦科学院办公楼掩映在一片绿树丛中。靠南边的办公室，透过每天中午打开的窗户，不时传来“咩咩咩”的叫声。院里的人都知道，院士“羊圈”里的羊要“吃食了”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t院士的实验“羊圈”，就在办公室后面四五百米处，对面是细毛羊基因工程实验室。院士的核心“羊场”，在离石河子几十公里远，一个叫“紫泥泉”的地方。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“羊圈”不是特别大，只有三百多只羊。十几只体格硕大、肉墩墩、长着犄角的种公羊，等待牧工“理发”剪羊毛。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t院畜牧兽医所副研究员王立民紧紧抓着一只羊的长犄角说：“刘老师培育的部分核心种群就在这里。这些细毛羊都是新疆美利奴军垦细毛羊的后代。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t牧工使劲将羊摁倒在地，羊才乖乖就范。牧工很快剪下一个毛套。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t畜牧兽医研究所所长周平说：“羊毛好，剪完就是一个完整的毛套，一点不散架。”他随便抓起一小缕毛，吹给我们看，“这些毛比人的头发丝还细，在14微米到18微米之间，头发在80—100微米之间。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t岂敢小看“羊圈”里的羊。如今，这些新疆美利奴军垦型细毛羊的后代，在天山南北的草原上随处可见。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t每每走进这个“羊圈”，刘守仁就情不自禁想起带给他希望和寄托的“紫泥泉种羊场”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t1955年秋，他从南京农学院毕业，主动要求到边疆工作。一个寒冷刺骨的冬天，一辆进山拉木头的嘎斯车，把他搁在这里。从此，他的命运就和这里连在了一起。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“以为新疆除了戈壁滩啥都没有，到了一看，那里有个小卖部，牙膏、肥皂、香皂都有，比想象中好多了。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“每天早晨一开门，天山雪峰仿佛近在咫尺，草场近在眼前，江南可看不到这种景象。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t在这里，他与羊群为伴，进行着绵羊品种培育的研究。他跑遍方圆百里的大草原，与哈萨克牧工同吃同睡，白天是牧羊人，夜晚钻在地窝子里整理资料。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t沐浴着日落日出，他在早出晚归中一干就是60年，先后培育出中国美利奴新疆军垦型细毛羊两个新品种、9个新品系，三获国家科技进步奖，改写了中国没有优质细毛羊的历史。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t<strong>“祖师爷”看了我的羊都服气</strong> \r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t在绵羊育种领域研究长达60年，三获国家科技进步奖，刘守仁是兵团第一人。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t院史陈列馆科技成果展板上清晰地列着：《中国美利奴羊新品种的育成》获1987年国家科技进步一等奖，《中国美利奴（新疆军垦型）繁育体系》获1991年国家科技进步一等奖，《中国美利奴肉用、超细毛、多胎肉用羊的培育》2007年获国家科技进步二等奖。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t在国际绵羊育种史上，一个新品种的产生通常经历杂交改良、横交固定和提高推广三个阶段，通常需要几十年甚至上百年。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t从上世纪50年代中期，刘守仁引用苏联阿尔泰细毛羊杂交改良新疆当地毛质粗劣的哈萨克土种羊，培育出蕴含着屯垦戍边含义的全新绵羊品种——军垦细毛羊，仅用了12年。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t军垦细毛羊，个体大，毛质好，生存能力强，产毛量比土种羊高出4.5倍。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t1968年，紫泥泉“军垦细毛羊”在北京农展馆展出，国内外为之轰动。中国宣布从此有了真正属于自己的细毛羊优良品种。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t讨教“秘诀”，刘守仁笑着说：“头两个阶段，我是边杂交，边横交固定，同时进行，以前没人这么搞过。我边试边干。当时国家纺织业急需好羊毛，哪里能等几十年。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t这个“秘诀”，后来被他发展为蜚声业界的“血亲级进育种方法”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t时隔多年，其间艰苦，他记忆犹新。“没有实验室，墨水瓶当试管，铁皮、竹片当试验工具，放大镜当显微镜，镊子当计数器”，“瞪大眼睛数一平方厘米有多少羊毛，一数就是三四个小时，双眼酸痛直流泪”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t军垦细毛羊培育成功后，他没有沉浸在喜悦中。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“羊毛拿到上海几家大型毛纺织厂试纺表明，它的长度、细度都不如澳毛，不能纺高档毛料。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t这使他感到十分内疚和震惊。他憋了一口气，下决心要为中国人争气，把“澳洲美利奴羊毛披到军垦细毛羊的身上”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t从1972年开始，他用美利奴种公羊与军垦细毛羊进行杂交，经过9个春夏秋冬反复试验，筛选繁育，成功培育出和澳大利亚美利奴羊相媲美的“中国美利奴（新疆军垦型）细毛羊”。这标志着我国细毛羊培育进入世界先进行列，在细毛羊品种资源方面不再受制于人。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“军垦细毛羊”让“紫泥泉种羊场”名声远扬。上世纪七八十年代，国内外专家络绎不绝跑来“取经”，连“美利奴羊祖师爷”澳大利亚的专家也万里迢迢来了。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“他们看了我的羊，都服气的呀。”刘守仁说。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t其间，他大胆采用系祖建系法，实行封闭育种，抓住优势个体确定系祖，采取近交，迅速增加畜群亲缘系数，使群体遗传性在杂交阶段稳定下来，在实践中不断完善“血亲级进育种方法”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“最大优点是挑选最优秀的种公羊，与母羊进行杂交产生一代羊，挑选出表型最好的一代母羊再与其他祖代优秀种公羊进行杂交产生二代，对二代进行强选择，增加淘汰率，挑选最好的后代母羊与祖代种公羊进行级进杂交产生三代。三代已含有体型一致的优秀种公羊的87.5％血液，此时就可以将三代进行封群繁育。还可以进行第四轮杂交，使四代达到祖代的血液93.75％。此时可将四代进行封群繁育。”他的弟子、研究员甘尚权解释道。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t<strong>母羊都生双羔该多好</strong> \r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t国际粮农组织预测，21世纪90％畜牧品种都将通过分子育种提供，有了良种就能在同样投入的条件下有更大产出。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t从传统育种到分子育种，对刘守仁来说也是一个新课题。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“每晚睡觉前都要想上半个小时问题”的他，筹措经费建立起了以基因工程、胚胎工程实验室为技术支持的科研开发平台；出资让学生到外地从名师读博士。现在的团队里，有院里一半以上的博士。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t他的团队从传统育种向分子育种发起“冲锋”。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t他主持的“超细毛及肥羔生物工程高技术产业化”示范工程项目，首次运用绵羊多胎主效基因标记方法，培育出中国美利奴羊多胎肉用新品系。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“在对新疆本地品种绵羊的多胎性状改良、育种上，刘老师对多胎分子辅助标记育种方法进行了创新，采用绵羊多胎主效基因分子改良、分子育种同步推进，使新疆本地品种绵羊在不改变其特性的情况下，又获得了多胎性，在绵羊品种培育手段上彻底实现了分子育种，加快了绵羊新品种的培育速度。”他的弟子、副研究员张云生说，“为了减少横交固定和选育提高这一漫长阶段，我们采用克隆技术将一只顶级细毛羊克隆成10个顶级细毛羊，使得种公羊数目由1只增加到10只，这些种公羊遗传背景高度一致，品种培育过程中优秀的杂交后代就可直接进行自体扩繁。”\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t对其间建立的绵羊多胎基因检测技术，刘守仁“情有独钟”，每有机会都呼吁推广。\r\n\t\t\t\t</p>\r\n\t\t\t\t<p style=\"text-indent:2em;\">\r\n\t\t\t\t\t“只需要少量血液，就能快速检测出母羊是否携带多胎基因，预测母羊群体的产羔情况。推广应用多胎基因检测技术，以兵团现有400万头绵羊为例，其中100万头基础母羊按20％出生双羔计算，就会多生20万个羊羔，效益有多大。”他笑着说。\r\n\t\t\t\t</p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t</div>\r\n\t<p>\r\n\t\t<br />\r\n\t</p>\r\n<span style=\"color:#333333;font-family:\" font-size:14px;background-color:#ffffff;\"=\"\"></span>',1503470972,1510883181,0,1,'admin'),(260,81,2,'','苏尼特草原羊“名羊天下”','苏尼特草原羊“名羊天下”',1,1,'<p>\r\n\t<br />\r\n</p>\r\n<ul>\r\n\t<li>\r\n\t\t<p style=\"text-align:center;\">\r\n\t\t\t<img src=\"http://nm.people.com.cn/NMediaFile/2015/0805/LOCAL201508051653000146807369848.jpg\" width=\"250\" height=\"167\" alt=\"\" /> \r\n\t\t</p>\r\n\t\t<p style=\"text-align:center;\">\r\n\t\t\t<span style=\"font-size:14px;line-height:1.5;\">中国·首届苏尼特羊产业发展论坛现场</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7月27日，寻找中国好食材—走进苏尼特左旗系列活动在内蒙古自治区锡林郭勒盟苏尼特左旗举行。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;苏尼特左旗是我国著名的肉羊品种—苏尼特羊的主要产区。本次活动的举办，将有助于更好的展示苏尼特左旗纯天然、无污染、绿色羊肉的特有品质及精深加工肉食品类产品成果，提高苏尼特羊知名度，拓展市场，扩大与国内外同行业的交流与合作，提升畜牧业发展水平和增加牧民收入。中国?首届苏尼特羊产业发展论坛、苏尼特羊剔骨比赛、赛畜展示、空中看草原、苏尼特左旗肉类食品协会成立仪式、鑫海肉食品有限公司开业仪式等系列活动同期举行。相关协会代表、行业专家、全国知名餐饮企业负责人等嘉宾共计200余人受邀参加活动。</span> \r\n\t\t</p>\r\n\t\t<p style=\"text-align:center;\">\r\n\t\t\t<img alt=\"\" src=\"http://nm.people.com.cn/NMediaFile/2015/0805/LOCAL201508051653000599772310428.jpg\" /> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;苏尼特左旗获“中国好食材—优质草原羊产供示范基地”荣誉称号，中国餐饮供应链管理协会名誉主席李丽婵向苏尼特左旗旗委副书记、政府旗长那仁满达颁发牌匾。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">千里寻羊 寻找中国好食材走进苏尼特左旗</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“寻找中国好食材——走进锡林郭勒”是一项为全国餐饮企业和锡林郭勒羊肉企业搭建专业采供对接平台的系列活动，于每年的7-8月份举办。这项活动最大的亮点即在于让全国知名的餐饮企业有机会深入到草原、工厂和牧场，身临其境的感受锡林郭勒草原羊的独特魅力。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;今年，第一位抵达苏尼特左旗的嘉宾是特意从杭州赶来的年逾七旬的浙江省餐饮行业协会常务副会长兼秘书长何也可。为了趁着这次“寻找中国好食材——走进苏尼特左旗”的机会到向往已久的锡林郭勒大草原来考察著名的苏尼特羊，何会长不辞辛劳的奔波了两千多公里。正如他所说：只有亲自来到这里，看到这么美的草原、这么天然绿色的环境，品尝到最正宗的苏尼特羊肉，才知道为什么说全国的羊肉内蒙古的最好，内蒙古的羊肉锡林郭勒的最好，这一趟，来得值！</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;像何会长这样不远千里来寻找好羊肉的行业协会、餐饮企业的来宾共有几十位。虽然他们来自杭州、北京、天津、呼和浩特等不同的城市，但都有同一个目的：来与苏尼特左旗的羊肉加工企业寻求深度的合作，为企业寻找好羊肉、好食材。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;名扬天下 打造优质草原羊产供基地</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;如果说实实在在的采购订单为企业带来了“鱼”，那么为苏尼特羊产业发展出谋划策则是让政府和企业皆大欢喜的“渔”了。中国?首届苏尼特羊产业发展论坛是此次活动中的重头戏。论坛邀请到了中国农科院、中国烹饪协会、中国餐饮供应链管理协会、内蒙古自治区餐饮与饭店行业协会的多位专家共同为苏尼特羊产业的发展建言献策。各位专家围绕“打造苏尼特羊品牌”这一主题，分别从行业趋势、产业特点、品牌营销等不同方向进行了阐述。专家们极具前瞻性、专业性和创新性的观点，对苏尼特羊产业的发展具有积极的借鉴意义。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;近年来，苏尼特左旗通过组织高峰论坛、召开产品推介会、参加大型专业展会等多种方式推动苏尼特羊产业发展，并收到了积极的效果，真正做到了让“名羊天下”的苏尼特羊名扬天下。在7月8-10日举办的中国?包头国际牛羊肉产业大会上，苏尼特左旗的多家羊肉加工企业都收获颇丰，在带来巨大经济效益的同时，也在全国范围内大大提升了苏尼特羊的知名度和影响力。越来越多的餐饮企业之所以将苏尼特左旗作为了羊肉食材的首选之地，就是因为他们都深知好食材创造好产品，好产品缔造好品牌的道理。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“寻找中国好食材——走进锡林郭勒”活动的发起单位之一——中国餐饮供应链管理协会，一直致力于为好食材产地和好餐饮品牌搭建资源合作的平台，促进双方的共赢发展。在这次论坛活动中，中国餐饮供应链管理协会向苏尼特左旗颁发了“中国好食材－优质草原羊产供基地”的奖牌。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;锡林郭勒羊肉以其天然、绿色、营养等特点备受社会赞誉。“苏尼特羊肉”也已成了高品质羊肉的代名词。然而，苏尼特羊肉也被一些问题所困扰：假冒的“锡林郭勒羊肉”充斥市场，锡林郭勒羊肉产品结构简单、利润率低，牧民增收较缓等等。</span> \r\n\t\t</p>\r\n\t\t<div>\r\n\t\t</div>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为此，早在2013年，锡林郭勒盟就着手开展羊肉全产业链追溯体系的建设。羊从一出生,羊羔就建立了自己的“身份证”——对它们的出生、饲养、病疫、屠宰、加工、物流、销售等各个环节建立了一整套完整的信息档案,只要用手机扫一下二维码，就能查出羊肉的产地、羊种、放牧记录、屠宰加工、配送等信息。建立起了从养殖到零售环节的一整套完善的监管体系,实现了各个环节的可查、可追溯。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;经过近两年时间的建设和运行，追溯体系的作用和优势日趋显现。在中国?首届苏尼特羊产业发展论坛上，苏尼特左旗鑫海肉食品有限公司与央视网上商城签订了合作协议。经过全新的包装和定位，全国独一无二的可追溯苏尼特草原羊一羊当先，出击高端羊肉市场。</span> \r\n\t\t</p>\r\n\t\t<p>\r\n\t\t\t<span style=\"font-size:18px;line-height:1.5;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“好产品有了好市场，才能让企业成长，才能让牧民增收，才能让锡林郭勒羊产业实现可持续的发展”，锡林郭勒盟经信委副主任、锡林郭勒盟肉类协会常务副会长哈斯海日汗一语道出真谛。（于海舰）&nbsp;</span> \r\n\t\t</p>\r\n\t\t<div>\r\n\t\t\t<br />\r\n<br />\r\n\t\t</div>\r\n\t</li>\r\n</ul>\r\n<p>\r\n\t<br />\r\n</p>',1503472377,1510913558,0,1,''),(261,81,2,'','内蒙古苏尼特羊靠“全程追溯”保正品','内蒙古苏尼特羊靠“全程追溯”保正品',1,1,'<p class=\"MsoNormal\">\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t<strong>“冒牌”搅局产业发展 内蒙古苏尼特羊靠“全程追溯”保正品</strong>\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　<a target=\"_blank\" href=\"http://www.chinanews.com/\">中新网</a>锡林郭勒7月27日电 (张林虎)内蒙古苏尼特左旗是我国著名的肉羊品种——苏尼特羊的主要产区，一直以来，苏尼特羊因抗寒能力强、肉质优、味道鲜等特点成为高品质羊肉的代名词。然而，其同时也饱受“冒牌”羊肉的搅局，扰乱正常产业发展。27日，在中国·首届苏尼特羊产业发展论坛上，专家建议通过完备的羊肉“追溯”体系可保证苏尼特羊肉“货真价实”。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　27日当天，盛夏的锡林郭勒大草原迎来远方客人。作为寻找中国好食材——走进苏尼特左旗系列活动的重头戏，中国·首届苏尼特羊产业发展论坛邀请了中国农科院、中国烹饪协会、中国餐饮供应链管理协会的多位专家前来参会探讨，为苏尼特羊产业发展“把脉”。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　内蒙古锡林郭勒盟经信委副主任哈斯海日汗在会上指出，苏尼特羊之所以有着“羊中至尊，肉中人参”的美誉，与其稀缺性、唯一性分不开，而这也是打造苏尼特羊品牌的关键。\r\n\t</p>\r\n\t<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\" style=\"color:#000000;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\" class=\"ke-zeroborder\">\r\n\t\t<tbody>\r\n\t\t\t<tr>\r\n\t\t\t\t<td>\r\n\t\t\t\t\t<div id=\"adhzh\" style=\"margin:0px;padding:0px;\">\r\n\t\t\t\t\t\t<div id=\"_wa5b5ntgay\" style=\"margin:0px;padding:0px;\">\r\n\t\t\t\t\t\t</div>\r\n\t\t\t\t\t\t<div style=\"margin:0px;padding:0px;\">\r\n\t\t\t\t\t\t</div>\r\n\t\t\t\t\t</div>\r\n\t\t\t\t</td>\r\n\t\t\t</tr>\r\n\t\t</tbody>\r\n\t</table>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　“草原类型不一样、羊的品质不一样、放牧方式不一样，这三种差异造就了苏尼特羊的独特性。”哈斯海日汗说。然而，正是由于苏尼特羊的稀缺、独特、高品质，市场上苏尼特羊肉的假冒伪劣产品也多不胜数。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　哈斯海日汗告诉记者，通常情况下，锡林郭勒盟一年生产销售的羊肉约为12万吨，但市场上销售的所谓“锡盟羊肉”的量却远不止这个数字。此外，许多商家为了傍名牌，将外地的羊运往锡林郭勒盟进行屠宰加工，其摇身一变便冠之以“锡盟羊”的美名，从而混淆视听、提高售价和销量。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　当天，针对此种问题，与会专家分别从行业发展趋势、产业结构特点、品牌营销、牧民增收等不同方面进行了阐述论证。多位专家指明了建设羊肉全产业链追溯体系的重要性。专家认为，追溯体系可以让外地人吃到真正的苏尼特羊肉。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　事实上，记者获悉，早在2013年，锡林郭勒盟就着手开展羊肉全产业链追溯体系的建设。当地的羊从出生起便建立了“身份证”，其内容是关于每只羊的出生、饲养、病疫、屠宰、加工、物流、销售等各个环节的信息档案。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　在市场销售环节，只要顾客用手机扫一下产品包装上的二维码，就能查出该羊肉的产地、羊种、放牧记录、屠宰加工、配送等信息。通过这一整套的从养殖到零售的监管体系，买卖双方可实现各个环节的可查、可追溯。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　目前，经过近两年时间的建设和运行，该产品追溯体系的作用和优势日趋显现，仍需进一步的建设与完善推进。\r\n\t</p>\r\n\t<p style=\"color:#333333;font-family:微软雅黑;font-size:15px;background-color:#EEF2F6;\">\r\n\t\t　　哈斯海日汗表示，好产品要有好市场，才能让企业成长、让牧民增收、让锡林郭勒羊产业实现可持续发展。未来，经过全新的包装和定位，全国独一无二的、可追溯的苏尼特草原羊将以更高姿态出击高端羊肉市场。\r\n\t</p>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\">\r\n\t<br />\r\n</p>',1503472662,1510655543,16,1,''),(262,81,2,'','舌尖上的锡林郭勒 |“名羊天下”的苏尼特羊','舌尖上的锡林郭勒 |“名羊天下”的苏尼特羊',1,1,'<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">锡林郭勒草原是世界驰名的四大草原之一，18万平方公里天然草场上野生种子植物和优质牧草种类繁多，造就了锡林郭勒羊肉品质上乘、肉质鲜嫩、营养成分富集的优良特点。“锡林郭勒的羊，吃的是中草药，喝的是矿泉水“，其肉产品绿色营养、纯天然、无污染，具物稀特性和唯一性，是羊肉中的珍品，驰名中外。</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">如果说锡林郭勒草原像一只翱翔的雄鹰，那么坐落于西北部的苏尼特左旗就像是雄鹰之首，在中国北部边疆雄视整个中国大地。</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">广袤富饶的苏尼特草原是闻名遐迩的纯天然牧场，也是著名的苏尼特羊的故乡，这里奔跑着被誉为“肉中人参”的苏尼特羊，声名享誉国内外。</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=7edb9b11d02a60595210e1121836342d/0278db24bc315c601b7c1c378ab1cb134b547780.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=bbf66c9b8cd4b31cf03c94b3b7d7276f/37bff4013af33a87184b77c2c15c10385243b548.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=15dbc4f0317adab43dd01b4bbbd6b36b/b9338beb15ce36d338fbf4e83df33a87eb50b1f7.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">苏尼特羊肉鲜嫩多汁，无膻味，肉层厚实又紧凑，高蛋白，低脂肪，瘦肉率高，肌间脂肪分布均匀，富有人体所需各种氨基酸和脂肪酸，容易消化等很多优点，是制作涮羊肉的最佳原料，深受国内外广大用户的高度评价和热烈欢迎。因经常采食丛生禾科和葱类牧草，使得羊肉肉质细嫩，味美多汁，高蛋白、低脂肪、无膻味，历来是北京东来顺饭庄羊肉之上等原料。据专家测定，苏尼特羊肉中，人体所必需的几种主要氨基酸含量，明显高于其它羊肉。苏尼特绵羊肉，曾是元、明、清朝皇宫供品，也是北京“东来顺”涮羊肉馆专用羊肉。</span></span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=0faf2131f5d3572c66e29cd4ba126352/503192a30cf431adce9135e14c36acaf2fdd982a.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=9927ddd5ffdcd100cd9cf829428947be/1a9fc419367adab4e80d6c9b8cd4b31c8501e495.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=d12f792f983df8dca63d8f99fd1372bf/52d7ba188618367a7b54080529738bd4b11ce595.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=f5ad14c416dfa9ecfd2e561f52d1f754/ee7273accbef76094c48ef4729dda3cc7dd99e2a.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">苏尼特草原得天独厚的气候条件使得草场上分布着多达200种野生植物。沙葱，野韭菜等等都是羊群最好的食物，而沙葱中富含多种微量元素，能够最大程度的分解羊身上的腥味和膻味，所以产自苏尼特草原上的羊肉，色泽鲜艳，肉层厚实，品质极好，用它能够成就各式各样的精彩美味儿……</span></span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=45b92869870a19d8cb03840d03fb82c9/49e2414e78f0f73626c53dd90d55b319eac413b2.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img src=\"https://imgsa.baidu.com/forum/w%3D580/sign=d6db76c2c15c1038247ececa8210931c/2e392e80800a19d883b5f2dd34fa828ba71e463f.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">手把肉，是蒙古族传统美食!而用苏尼特羊制作的手扒肉更是让人垂涎欲滴，欲罢不能!选取一到两岁的羊来做原料，是制作这道经典美味的唯一秘诀，将新鲜的羊肉解开，直接放入盛满凉水的锅中，用大火烹煮，让生鲜羊肉随着锅里的水温慢慢加热，直到香味逐渐涌现，高端的食材往往只需最朴素的烹饪方式，只要撒上一把咸盐，剩下的交给时间即可。。这是蒙古族人民熟悉的味道，更是招待四方贵宾最为经典的味道!</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">带您认识一下风靡全国的苏尼特羊肉</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">苏尼特羊肉，是中国地理标志产品。苏尼特羊属蒙古绵羊系统中的一类群，在苏尼特草原特定生态环境中经过长期的自然选择和人工选择而形成分布在内蒙古中部草原，苏尼特羊生产的羊肉，即苏尼特羊肉。</span><br />\r\n<img class=\"BDE_Image\" width=\"560\" height=\"350\" src=\"https://imgsa.baidu.com/forum/w%3D580/sign=ee5d94fe0e24ab18e016e13f05fbe69a/b5aa53dea9ec8a13df1c2638f003918fa1ecc068.jpg\" /><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">营养价值及口感苏尼特羊肉号称“肉中人参”，据测定，苏尼特羊肉粗蛋白质含量19.5%，粗脂肪含量3.14%，失水率13.79%，碘价27.96%。脂肪酸的不饱和程度低，脂肪品质好。肌肉的6种主要脂肪酸，即豆蔻酸、软脂酸、硬脂酸、油酸、亚油酸和亚麻酸的累计组成占肌肉总脂肪酸含量的93.2%～96.93%，其中油酸和硬脂酸含量最高，分别为48.07%和17.04%。苏尼特羊肉的各种氨基酸含量较高，特别是谷氨酸和天门冬氨酸的含量比其他羊肉高，因此，苏尼特羊肉鲜味较浓，味道较好。</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">除了营养价值高之外，苏尼特羊肉鲜嫩多汁，无膻味，肉层厚实紧凑，高蛋白，低脂肪，瘦肉率高，肌间脂肪分布均匀，富有人体所需各种氨基酸和脂肪酸，容易消化，是制作涮羊肉的最佳原料，曾是元、明、清朝皇宫供品。</span><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<br />\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><br />\r\n</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><img class=\"BDE_Image\" width=\"560\" height=\"420\" src=\"https://imgsa.baidu.com/forum/w%3D580/sign=b996f7f99413b07ebdbd50003cd69113/53b371fb828ba61eeab7b8f74634970a314e5910.jpg\" /><br />\r\n<br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">苏尼特羊的特点苏尼特羊体格大，体质结实，结构均匀，公、母羊均无角，头大小适中，鼻梁隆起，耳大下垂，眼大明亮，颈部粗短。种公羊颈部发达，毛长达15～30cm。背腰平直，体躯宽长，呈长方形，尻高稍高于鬐甲高，后躯发达，大腿肌肉丰满，四肢强壮有力，脂尾小呈纵椭圆形，中部无纵沟，尾端细而尖且向一侧弯曲。被毛为异质毛，毛色洁白，头颈部、腕关节和飞节以下部、脐带周围有有色毛。</span><br />\r\n<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\">成年公羊平均体重78.83kg，成年母羊58.92kg；育成公羊平均体重59.13kg，育成母羊49.48kg。该羊产肉性能好，10月份屠宰成年羯羊、18月龄羯羊和8月龄羔羊，胴体重分别为36.08kg，27.72kg和20.14kg；屠宰率分别为55.19%，50.09%和48.2%；瘦肉率为70.6%，70.52%和69.95%。</span><br />\r\n</span>\r\n</p>\r\n<div>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><br />\r\n</span>\r\n</div>\r\n<div>\r\n\t<span style=\"color:#333333;font-family:&quot;font-size:15px;background-color:#FFFFFF;\"><br />\r\n</span>\r\n</div>',1503477486,1510655483,10,1,'星币网'),(263,84,3,'','美利奴羊毛改变你对羊毛的认识','美利奴羊毛改变你对羊毛的认识',0,0,'<div style=\"text-align:left;\">\r\n\t<span style=\"color:#444444;font-family:&quot;background-color:#FFFFFF;font-size:14px;\">美利奴羊毛英文名字Merino Wool，顾名思义就是美利奴羊所产的羊毛。如果说羊毛是上帝赐予人类最好的自然纤维，那么美利奴羊毛就是上帝赐予人们最好的保暖圣品。俗话说，好羊产好毛，那美利奴就是非好羊莫属了！世界上几乎所有细羊毛品种都是产自美利奴绵羊或以美利奴血统为主的绵羊身上的。</span>\r\n</div>\r\n<span style=\"color:#444444;font-family:&quot;background-color:#FFFFFF;font-size:18px;\">\r\n<div style=\"text-align:left;\">\r\n\t<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;羊毛种类的划分有很多种方式，如果按羊毛品质的好坏划分的话，那么美利奴羊所产的一定是世界上最好的细羊毛！光看美利奴羊那身肥硕的厚皮和威武的螺旋式羊角，就属于气场强大的贵族品种。美利奴羊毛超细腻，超柔软，毛被质量均匀且含油脂量高。以美利奴血统为主的细毛羊遍布世界各地，其产毛量约占世界羊毛产量的三分之一。</span>\r\n</div>\r\n</span><span style=\"color:#444444;font-family:&quot;background-color:#FFFFFF;font-size:18px;\">\r\n<div style=\"text-align:left;\">\r\n\t<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;美利奴羊毛具有独特的调节湿度和温度的特性，是世界上功能性领先的纤维之一。美利奴羊毛纤维具有很好的透气性和调温性，在内部气体转移的时候可以形成微观气候，外界过看、冷时会起到保暖作用，外界过热时会比较凉爽，其特有的吸湿功能可以吸收自身干重35%的湿气，在出汗时将贴近皮肤的湿气从皮肤上带走，减少人体的湿冷感。，实现吸湿与增强干燥的作用。这也是为什么美利奴羊毛服饰会给人一种冬暖夏凉即使出汗也会有干爽舒适感觉的原因。</span>\r\n</div>\r\n</span>\r\n<div style=\"text-align:left;\">\r\n\t<span><br />\r\n</span>\r\n</div>\r\n<div style=\"text-align:left;\">\r\n\t<br />\r\n</div>',1510654478,1510654478,0,0,''),(264,0,3,'','甘肃省培育出我国首例高山美利奴羊','甘肃省培育出我国首例高山美利奴羊',0,0,'<p style=\"font-size:16px;font-family:微软雅黑;color:#333333;text-align:center;\">\r\n\t　　<strong>我省培育出我国首例高山美利奴羊</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:微软雅黑;color:#333333;text-align:center;\">\r\n\t<strong>填补了世界高海拔生态区细型细毛羊育种空白　</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:微软雅黑;color:#333333;\">\r\n\t　　<strong>每日甘肃网-甘肃经济日报1月11日讯</strong>(记者庄俊康)历经20载，我省培育出我国首例高山美利奴羊。近日该品种通过了国家畜禽遗传资源委员会新品种审定，填补了世界高海拔生态区细型细毛羊育种的空白，是我国高山细毛羊培育的重大突破，达到国际领先水平。\r\n</p>\r\n<div style=\"font-family:微软雅黑, 微软雅黑, Tahoma, SimSun;font-size:14px;\">\r\n\t<p style=\"font-size:16px;font-family:微软雅黑;color:#333333;\">\r\n\t\t　　高山美利奴羊是由中国农业科学院兰州畜牧与兽药研究所联合甘肃省绵羊繁育技术推广站等7家单位，历经20载，以澳洲美利奴羊为父本、甘肃高山细毛羊为母本，运用现代育种先进技术成功培育的我国首例适应高海拔高山寒旱生态区的细型细毛羊新品种。该品种适应2400-4070米生态区，具有良好的抗逆性和生态差异化优势，羊毛细度达到19.1-21.5微米，性能指标和综合品质超过了同类型澳洲美利奴羊，实现了澳洲美利奴羊在我国高海拔高山寒旱生态区的国产化，丰富了羊品种资源的结构。据预测，每年可推广新品种种公羊1.6万只，改良细毛羊600万只，新增产值可达10亿元。这对于促进我国细毛羊产业升级，满足我国毛纺工业特别是高档羊毛的需求，提升国际竞争力，改善广大农牧民的生活生产，具有极其重要的经济价值、生态地位和社会意义。\r\n\t</p>\r\n\t<div>\r\n\t\t<br />\r\n\t</div>\r\n</div>',1510654558,1517822587,0,0,''),(265,82,4,'','绒毛用羊示范推广团队到呼伦贝尔市、兴安盟进行实地调研','绒毛用羊示范推广团队到呼伦贝尔市、兴安盟进行实地调研',0,0,'<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　&nbsp;&nbsp;&nbsp;&nbsp;<span>自治区家畜改良工作站（自治区绒毛用羊科技服务体系示范推广团队）</span><span>到</span><span>呼伦贝尔市、兴安盟</span><span>进行了实地调研，对呼伦贝尔细毛羊、兴安细毛羊目前的状况、今年细毛羊剪毛情况、羊毛的销售及价格等进行了了解，具体情况如下：</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>呼伦贝尔细毛羊</span><span>是在</span><span>呼伦贝尔</span><span>生态条件下经多年培育而成的毛肉兼用型品种。一九</span><span>九五</span><span>年内蒙古自治区人民政府正式命名</span><span>，是我区八大细毛羊培育品种中最后一个培育的细毛羊品种。</span><span>这次对呼伦贝尔细毛羊的主产地阿荣旗、莫力达瓦旗、扎兰屯市等进行了实地调研，目前阿荣旗细毛羊的存栏数为<span>40</span><span>万只，莫力达瓦旗为</span><span>32</span><span>万只、扎兰屯市为</span><span>30</span><span>万只。但真正的呼伦贝尔细毛羊已经所省无几了，尽管自从培育出呼伦贝尔细毛羊以来，多次引进澳洲美利奴强毛型和细毛型种公羊进行导血，进一步提高了细毛羊的生产性能，但近十多年来，随着羊毛价格停滞和羊肉价格的飙升，小尾寒羊、德国美利奴羊、蒙古大尾羊等杂交羊已占市场主体。</span></span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t<span><a href=\"http://www.nmagri.gov.cn/images/zxq/bmdt/2015/9/24/0BA7E60CBA1C458B8F82870F78407EF1.jpg\" target=\"_blank\"><img border=\"0\" alt=\"绒毛用羊示范推广团队到呼伦贝尔市、兴安盟进行实地调研\" src=\"http://www.nmagri.gov.cn/images/zxq/bmdt/2015/9/24/s0BA7E60CBA1C458B8F82870F78407EF1.jpg\" width=\"300\" height=\"240\" style=\"width:300px;height:240px;\" /></a>&nbsp;&nbsp; &nbsp;&nbsp;<a href=\"http://www.nmagri.gov.cn/images/zxq/bmdt/2015/9/24/6D718306355B415BAA45DD0E9758B30A.jpg\" target=\"_blank\"><img border=\"0\" alt=\"绒毛用羊示范推广团队到呼伦贝尔市、兴安盟进行实地调研\" src=\"http://www.nmagri.gov.cn/images/zxq/bmdt/2015/9/24/s6D718306355B415BAA45DD0E9758B30A.jpg\" /></a></span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>兴安细毛羊</span><span>是在</span><span>兴安盟</span><span>生态条件下经多年培育而成的毛肉兼用型品种</span><span>，</span><span>一九</span><span>九一</span><span>年内蒙古自治区人民政府正式命名</span><span>。这次对兴安细毛羊的两个自治区级种畜场进行了调研，</span><span>走访了兴安细毛羊核心产区内蒙古自治区兴安细毛羊原种场（公主陵牧场）、呼格吉勒图种畜场（扎旗种畜场）等，从实地调研情况来看，目前兴安细毛羊主要集中饲养在公主陵牧场和扎旗种畜场。公主陵牧场：现有细毛羊基础母羊6400只，种公羊180只。其中质量好的纯细毛羊群有8个，有基础母羊1730只，质量稍差或以细毛为主但混有一定数量粗毛羊的群有6个，有基础母羊780只。另外全场散户中饲养的细毛羊还有3000多只。全场细毛羊羔羊约2000只。扎旗种畜场：现有细毛羊基础母羊600只，分2个群饲养，种公羊30只，育成公羊50只，羔羊300只，另外混群饲养的有200多只。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>羊毛销售情况：</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>近几年全区细羊毛销售乐观，价格年年趋稳，并稳中有升，销售看好，没有出现滞留细羊毛现象。细羊毛稍好点儿的地区，产毛量达5-6千克，销售价格11-12元；差些的产毛量4—4.5千克，销售价格7-8元，比往年提高了4-6元／千克。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>通过这次调研，了解到群众养殖细毛羊的积极性在逐年提高，尽管细毛羊羔羊较弱，需要精细管理，但因为羊毛价格在逐年提高，细毛羊皮价格比当地羊的要高点儿，细毛羊肉品质好，特别是近两年羊肉价格的大幅下滑，使得广大农牧民养殖细毛羊的积极性有所回升。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>建议及措施：</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>1、种公羊缺乏，后备公母羊也不足，优质种公羊更少，有些群体已出现退化现象。建议：制定优惠政策措施，切实加强对细毛羊生产的扶持力度。首先要采取有效措施，坚决遏制细毛羊倒改。建议划定细毛羊保种区，保种区内选用优质细毛羊进行同质选配，严格禁止引入其它品种特别是粗毛羊进行杂交；其次是对细毛羊种羊场要在资金、基础设施建设等方面给予扶持；三是对购入的优质细毛羊种羊实行补贴；四是建立细毛羊品种保护项目，将细毛羊品种保护工作纳入我区畜牧业工作的重要日程，在保持细毛羊原有品种特点的基础上，进一步提高被毛品质和产肉率。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>2、适应市场需求，</span><span>提高羊毛品质。</span><span>近几年，细型、超细型细毛羊发展势头很好，主要是为满足轻薄面料的市场需求。我区也要适应不断变化的市场，</span><span>采用育种常规技术和现代高新生物技术，对现有细毛羊进行导血改良，培育细型高产毛肉兼用型细毛羊，</span><span>提高细毛羊的综合生产水平。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>3、加强细毛羊繁育体系建设。要加强原种场建设，不断改善细毛羊种畜场的基础设施建设，制定和完善技术工作方案，提高细毛羊种羊供种能力；其次要依靠政府推动细毛羊基地的建设，建立完善的细毛羊生产服务体系。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;font-size:14px;background-color:#FFFFFF;\">\r\n\t　　<span>4、</span><span>建立健全细毛羊生产科技支撑体系，提高细毛羊生产技术含量。在种羊生产中，积极引进推广胚胎移植技术，迅速扩大优质种公羊的数量，为面上推广提供种源保障。</span><span>在细毛羊保种区，组建细毛羊育种核心群，引进优质的澳美种公羊或含澳血较多的种公羊进行同质选配，不断选育提纯，提高种群质量。</span><span>加大培训力度，使农牧民掌握丰富的饲养细毛羊的知识，提高饲养细毛羊的技术水平。</span>\r\n</p>',1510655118,1510655118,0,0,''),(266,82,4,'','呼伦贝尔细毛羊正式列入国家家畜品种名录','呼伦贝尔细毛羊正式列入国家家畜品种名录',0,0,'<p style=\"font-family:宋体;font-size:14px;\">\r\n\t<span>　近日，国家品种资源委员会专家组一行</span><span style=\"font-family:仿宋_GB2312;\">5</span>人抵达扎兰屯市，对呼伦贝尔细毛羊进行品种验收。呼伦贝尔细毛羊是<span style=\"font-family:仿宋_GB2312;\">1995</span>年<span style=\"font-family:仿宋_GB2312;\">5</span>月经自治区政府命名的地方品种。扎兰屯市既是呼伦贝尔细毛羊主产区之一，同时也是呼伦贝尔细毛羊“原种羊场”所在地。专家组一行先后深入到高台子、雅尔根楚等乡镇养羊户家中实地检查验收。专家组对扎兰屯市细毛羊养殖和发展现状给予了高度评价。呼伦贝尔细毛羊通过国家品种资源专家组验收，呼伦贝尔细毛羊正式列入国家家畜品种名录。<span style=\"font-family:黑体;\"></span>\r\n</p>\r\n<p class=\"MsoNormal\" style=\"font-family:宋体;font-size:14px;text-indent:22.6pt;\">\r\n\t<span>据了解，呼伦贝尔细毛羊产于呼伦贝尔市岭东的扎兰屯市、阿荣旗和莫力达瓦旗，岭西也有少量分布，</span><span style=\"font-family:Arial;\">1995</span><span>年</span><span style=\"font-family:Arial;\">5</span><span>月内蒙古自治区政府命名为</span><span style=\"font-family:Arial;\">“</span><span>呼伦贝尔细毛羊</span><span style=\"font-family:Arial;\">”</span><span>新品种。</span>呼伦贝尔细毛羊是根据呼伦贝尔市自然条件、经济条件及市场需要，经历了杂交改良、横交固定和导血提高三个阶段，经近四十多年的育种工作，培育成的细毛羊新品种。育种区内的细毛羊具有相似的血统来源，体型外貌一致，遗传性稳定，生产性能高，羊毛综合品质好现有达到品种标准的羊<span style=\"font-family:Verdana;\">25.6</span>万只，其突出特点是体格大、后躯丰满、肉用性能好。\r\n</p>\r\n<div>\r\n\t<br />\r\n</div>',1510655158,1510655158,0,0,''),(267,81,2,'','苏尼特羊简介','苏尼特羊介绍',0,0,'<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-weight:700;\"><span style=\"font-family:宋体;font-size:18px;\">苏尼特羊起源</span></span> \r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <img src=\"http://www.sntyr.com/upload/images/2014-05-14-0900aec561-619a-49eb-8135-9349dfbccfda.jpg\" />苏尼特羊，<span style=\"font-family:宋体;\">也称戈壁羊，属蒙古绵羊系统中的一类肉用地方良种，</span><span style=\"font-family:宋体;\">在苏尼特草原特定生态环境中经过长期的自然选择和人工选择而形成。具有耐寒、抗旱、生长发育快、生命力强、最能适应荒漠半荒漠草原的一个肉用地方良种。主要分布在内蒙古自治区锡林郭勒盟苏尼特左旗、苏尼特右旗，乌兰察布市四子王旗，包头市达茂联合旗和巴彦淖尔市的乌拉特中旗等地。苏尼特绵羊肉，曾是元、明、清朝皇宫供品，也是北京“东来顺”涮羊肉馆专用羊肉。</span>1986<span style=\"font-family:宋体;\">年被锡林郭勒盟技术监督局批准为地方良种，</span>1997<span style=\"font-family:宋体;\">年内蒙古自治区人民政府正式命名。</span> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-weight:700;\"><span style=\"font-family:宋体;font-size:18px;\">外形特征</span></span> \r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-family:宋体;\">&nbsp;&nbsp;&nbsp;&nbsp;苏尼特羊体格大，体质结实，结构均匀，公、母羊均无角，头大小适中，鼻梁隆起，耳大下垂，眼大明亮，颈部粗短。种公羊颈部发达，毛长达</span>15<span style=\"font-family:宋体;\">～</span>30cm<span style=\"font-family:宋体;\">。背腰平直，体躯宽长，呈长方形，尻高稍高于鬐甲高，后躯发达，大腿肌肉丰满，四肢强壮有力，脂尾小呈纵椭圆形，中部无纵沟，尾端细而尖且向一侧弯曲。被毛为异质毛，毛色洁白，头颈部、腕关节和飞节以下部、脐带周围有有色毛。</span> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;text-align:center;\"=\"\"> <img title=\"2014-06-19-15836540dc-ae73-4ab6-80e6-00e02b469562.jpg\" src=\"http://www.sntyr.com/upload/images/2014-06-23-20fcb61774-6a02-4686-bb6f-72932583a390.jpg\" /> \r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-weight:700;\"><span style=\"font-family:宋体;font-size:18px;\">分布地区</span></span> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-family:宋体;\">&nbsp;&nbsp;&nbsp;&nbsp;内蒙古自治区锡林郭勒盟苏尼特左旗、苏尼特右旗，乌兰察布市四子王旗，包头市达茂联合旗和巴彦淖尔市的乌拉特中旗等地。</span> \r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;text-align:center;\"=\"\"> <img title=\"2014-06-19-56663b2344-d32d-4122-a89c-ed2d4cae8e05.jpg\" src=\"http://www.sntyr.com/upload/images/2014-06-23-4867e3e063-9ca1-410c-96f9-f1b00a67604b.jpg\" /> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"><br />\r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-weight:700;\"><span style=\"font-family:宋体;font-size:18px;\">品种特性</span></span> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-family:宋体;\">&nbsp;&nbsp;&nbsp;&nbsp;成年公羊平均体重</span>78.83kg<span style=\"font-family:宋体;\">，成年母羊</span>58.92kg<span style=\"font-family:宋体;\">；育成公羊平均体重</span>59.13kg<span style=\"font-family:宋体;\">，育成母羊</span>49.48kg<span style=\"font-family:宋体;\">。该羊产肉性能好，</span>10<span style=\"font-family:宋体;\">月份屠宰成年羯羊、</span>18<span style=\"font-family:宋体;\">月龄羯羊和</span>8<span style=\"font-family:宋体;\">月龄羔羊，胴体重分别为</span>36.08kg<span style=\"font-family:宋体;\">，</span>27.72kg<span style=\"font-family:宋体;\">和</span>20.14kg<span style=\"font-family:宋体;\">；屠宰率分别为</span>55.19%<span style=\"font-family:宋体;\">，</span>50.09%<span style=\"font-family:宋体;\">和</span>48.2%<span style=\"font-family:宋体;\">；瘦肉率为</span>70.6%<span style=\"font-family:宋体;\">，</span>70.52%<span style=\"font-family:宋体;\">和</span>69.95%<span style=\"font-family:宋体;\">。苏尼特羊产肉性能好，瘦肉率高，含蛋白高、脂肪低，膻味轻，是制作涮羊肉的最佳原料，北京市东来顺饭庄涮羊肉用的肉就是苏尼特羊肉，深受国内外用户的好评。经过化学成分分析，粗蛋白质含量</span>19.5%<span style=\"font-family:宋体;\">，粗脂肪含量</span>3.14%<span style=\"font-family:宋体;\">，失水率</span>13.79%<span style=\"font-family:宋体;\">，碘价</span>27.96%<span style=\"font-family:宋体;\">。脂肪酸的不饱和程度低，脂肪品质好。肌肉的</span>6<span style=\"font-family:宋体;\">种主要脂肪酸，即豆蔻酸、软脂酸、硬脂酸、油酸、亚油酸和亚麻酸的累计组成占肌肉总脂肪酸含量的</span>93.2%<span style=\"font-family:宋体;\">～</span>96.93%<span style=\"font-family:宋体;\">，其中油酸和硬脂酸含量最高，分别为</span>48.07%<span style=\"font-family:宋体;\">和</span>17.04%<span style=\"font-family:宋体;\">。苏尼特羊肉的各种氨基酸含量较高，特别是谷氨酸和天门冬氨酸的含量比其他羊肉高，正因为这样，苏尼特羊肉鲜味浓，味道特别好。</span> \r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-family:宋体;\">　　苏尼特羊一年剪</span>2<span style=\"font-family:宋体;\">次毛，成年公羊平均剪毛量为</span>1.7<span style=\"font-family:宋体;\">±</span>O<span style=\"font-family:宋体;\">．</span>3kg<span style=\"font-family:宋体;\">，成年母羊</span>1.35<span style=\"font-family:宋体;\">±</span>0.28&nbsp;kg<span style=\"font-family:宋体;\">，周岁公羊</span>1.3<span style=\"font-family:宋体;\">±</span>0.2&nbsp;kg<span style=\"font-family:宋体;\">，周岁母羊</span>1.26<span style=\"font-family:宋体;\">±</span>O.16kg<span style=\"font-family:宋体;\">。苏尼特羊毛被中无髓毛占</span>52%<span style=\"font-family:宋体;\">～</span>61%<span style=\"font-family:宋体;\">，两型毛占</span>3%<span style=\"font-family:宋体;\">～</span>4%<span style=\"font-family:宋体;\">，有髓毛占</span>8%<span style=\"font-family:宋体;\">～</span>11%<span style=\"font-family:宋体;\">，干死毛占</span>28%<span style=\"font-family:宋体;\">～</span>33%<span style=\"font-family:宋体;\">。</span> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;\"=\"\"> <span style=\"font-family:宋体;\">　　苏尼特羊繁殖能力中等，经产母羊的产羔率为</span>110%\r\n\t</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;text-align:center;\"=\"\"> <img title=\"2014-06-19-4808f4b46e-9682-4442-9708-50e5a6acb7a1.jpg\" src=\"http://www.sntyr.com/upload/images/2014-06-23-235252d2db-9fa4-467c-b63c-d4dacea15cb4.jpg\" /> \r\n</p>\r\n<p style=\"color:#676A6C;font-family:\" font-size:16px;background-color:#ffffff;text-align:center;\"=\"\"> <img src=\"http://www.sntyr.com/upload/images/2014-05-14-09bf0d7686-c28a-4a86-80e5-ae454e784c2e.jpg\" /> \r\n\t</p>\r\n\t<div>\r\n\t\t<br />\r\n\t</div>',1510655958,1510656550,0,0,''),(268,81,2,'','苏尼特羊—特别能走的羊','苏尼特羊—特别能走的羊',0,0,'<p>\r\n\t<strong>导读：</strong><span style=\"color:#222222;font-family:tahoma, arial, &quot;font-size:14px;background-color:#FEFDFA;\">[科技苑]特别能走的羊20161018。苏尼特羊因为能走，被当地人成为马拉松羊。它每天至少要走30公里，因为长途跋涉苏尼特羊的身上发生了一系列的变化，肉质业是十分鲜美。人工圈养之后为了确保苏尼特羊肉原有的特性，养殖户又要怎么做呢？</span>\r\n</p>\r\n<p>\r\n\t<span style=\"color:#222222;font-family:tahoma, arial, &quot;font-size:14px;background-color:#FEFDFA;\"><img src=\"http://www.371zy.com/uploads/allimg/161018/2_161018213231_1.png\" alt=\"[科技苑]苏尼特羊—特别能走的羊\" /><br />\r\n</span>\r\n</p>',1510656308,1510656308,0,0,''),(270,0,2,'','获益农业供给侧改革 养殖历史超800年的苏尼特羊将','获益农业供给侧改革 养殖历史超800年的苏尼特羊将\"走上\"大众餐桌',0,0,'<p align=\"center\" style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　<img alt=\"\" src=\"http://i.ce.cn/ce/cysc/zljd/gd/201612/29/W020161229442002571533.jpg\" /> \r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　<span>12月29日上午举行的“隆冬·来自锡林郭勒大草原的问候——2016苏尼特羊肉产品（北京）新闻发布会上中共苏尼特右旗委书记佈仁在致辞。满珠/摄</span> \r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　中国经济网北京12月29日讯 随着农业供给侧改革的不断深入，一些“藏在深闺人未识”的优质农副产品迎来了新的发展机遇，一些品牌将崛起。“在‘十三五’期间，苏尼特右旗委、政府将大力支持苏尼特羊养殖企业开拓高端羊肉市场，对牧民给予相关政策扶持。协调企业对苏尼特羊肉进行深加工产品开发，对外联系市场和品牌推广，大力借助电子商务、新媒体等模式积极开拓苏尼特羊肉市场。”中共苏尼特右旗委书记佈仁在今天上午举行的“隆冬·来自锡林郭勒大草原的问候——2016苏尼特羊肉产品（北京）新闻发布会上如是致辞。\r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　据介绍，苏尼特右旗委、政府将立足国家政策，切实贯彻创新、协调、绿色、开放、共享的发展理念，实施优质特色现代化畜牧业战略，实施政企互动，媒体监督等机制，为拉动地方经济建设和发动社会各界人士共同为苏尼特右旗经济社会全面发展群策群力。\r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　中国经济网记者了解到，过去由于受物流等因素的影响，苏尼特羊肉很难为内地消费者所享用，为了让更堵百姓吃上养殖历史超800年的苏尼特羊肉，12月28日由中共苏尼特右旗委、政府主办、内蒙古羊羊牧业股份有限公司协办、中央电视台农业影视中心、“佳七有约”互联网平台联合承办的“隆冬·来自锡林郭勒大草原的问候——2016苏尼特羊肉产品（北京）新闻发布会” 在京举办，苏尼特羊肉将“走上”更多百姓餐桌。\r\n</p>\r\n<p align=\"center\" style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　<img alt=\"\" src=\"http://i.ce.cn/ce/cysc/zljd/gd/201612/29/W020161229442002682431.jpg\" /> \r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　<span>内蒙古羊羊牧业股份有限公司与北京新发地签约。更多的苏尼特羊肉将\"走上\"大众餐桌 。满珠/摄</span> \r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　苏尼特右旗位于内蒙古自治区中部，锡林郭勒盟西部，是锡林郭勒盟的西大门，该区域是“国家地理标志保护产品”——苏尼特羊的核心产区。 苏尼特羊是在苏尼特草原特定的生态环境条件下经过长期的自然选择而形成的地方良种羊，养殖历史已超过800年。因为苏尼特羊的“独特性”，近年来已被列为“国家地理标志保护产品”和“国家畜禽遗传资源保护名录”。\r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　苏尼特羊肉肉层厚实紧凑，高蛋白，低脂肪，瘦肉率高，肌间脂肪分布均匀，肉质鲜嫩多汁，肥而不腻，无膻味，富有人体所需各种氨基酸和脂肪酸，具有补气滋养、暖中补虚、开胃健力的功效，有着“熊猫羊”的美称，历来受国内外食客的好评。同时也是北京“东来顺”涮羊肉专用羊肉。近年来，随着电子商务等新兴营销模式发展和新媒体的崛起以及快速物流模式的完善，苏尼特羊迎来了最好的品牌崛起时机。\r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　据悉，主办方启动了“我要养只苏尼特羊”——苏尼特羊认养活动。消费者可以和苏尼特当地牧民或企业签订认养协议，认养苏尼特大草原为广大消费者精挑细选的羔羊，只需几个月便可品尝来自内蒙古大草原纯正的味道。主办方还在现场派送了“苏尼特羊肉大礼包”，让有着“肉中人参”美称的苏尼特羊肉大礼包，成为北京市民2016年冬天最暖心的礼物，共享苏尼特牧民收获的喜悦，促进苏尼特右旗特色羊肉产品与北京各相关产业链企业的沟通交流，为苏尼特右旗优质高效畜牧业发展增添活力。\r\n</p>\r\n<p style=\"font-size:16px;color:#434343;font-family:宋体;background-color:#FFFFFF;\">\r\n\t　　在苏尼特右旗委、政府相关部门领导的见证下，发布会现场共有14家企业与内蒙古羊羊牧业股份有限公司签订了战略合作协议，依托双方产销优势建立系统合作平台，本着“发挥优势、相互促进、长期合作、互利互赢”的原则推进战略合作，努力扩大双方合作的深度和广度，着力开发苏尼特羊肉品牌产品的品牌推广及营销，以此提高双方经济效益，实现互利共赢。 （岚焉）\r\n</p>',1510657173,1517821047,0,0,''),(272,0,24,'','关注我们','',1,1,'重要通知：为了让大家更快提币，更快把我们的比特A全部快速分发出去，我们将在2月1日至5日期间举办：三倍比特A分成的大型活动，2月1日至5日期间，你邀请的好友注册比特A后，你将获得随机三倍奖励，即m1就有机会获得3倍即3000枚比特A！请大家利用好活动的这几天，多分享，所剩时间不多了！&nbsp;\r\n',1517819380,1517823151,0,0,''),(273,0,24,'','','',0,0,'重要通知：比特A第一期奖励，因参与人数众多，所剩TOKEN数量不多，请推广的同学，加紧。待第二期，所奖TOKEN将减半。\r\n比特A是将基于eos公链开发的全免费TOKEN。应用于诸多实际场景。100亿币全盘免费分发赠送，官方坚持一币不留，真正去中心化，人人持有。\r\n近期将公布，比特A的详细应用场景，以及上线分发时间及相关教程，文档。现为最佳赚币时间，第一期比特A赠送幅度最大，随着时间的推移，奖励会逐步减少,请尽快推广。\r\n',1517823229,1517823229,0,0,'');

