  `password` varchar(255) DEFAULT NULL COMMENT '登录账号',
  `dealpassword` varchar(255) DEFAULT NULL COMMENT '交易密码',
  `phone` varchar(255) DEFAULT NULL COMMENT '电话',
  `phonetime` int(11) DEFAULT NULL COMMENT '电话认证时间',
  `username` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `idcard` varchar(255) DEFAULT NULL COMMENT '身份证',
  `status` varchar(255) DEFAULT '1' COMMENT '状态',
  `logins` varchar(255) DEFAULT NULL COMMENT '登录次数',
  `addip` varchar(255) DEFAULT NULL COMMENT '登录ip',
  `addtime` int(11) DEFAULT NULL COMMENT '注册时间',
  `endtime` int(11) DEFAULT NULL COMMENT '最后修改时间',
  `email` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `invit` varchar(255) DEFAULT NULL COMMENT '邀请码',
  `pid` varchar(255) DEFAULT NULL COMMENT '父级id',
  `yanze` int(11) DEFAULT '0' COMMENT '显示是否实名验证',
  `loginnum` int(11) DEFAULT NULL COMMENT '登陆次数',
  `logintime` int(11) DEFAULT NULL COMMENT '登录时间',
  `loginci` int(11) DEFAULT '6' COMMENT '登录密码错误六次不在能登陆',
  `agent` int(11) NOT NULL DEFAULT '1' COMMENT '是否开通经理人 1开通 2没有开通',
