  `type` int(1) NOT NULL DEFAULT '0' COMMENT '用户在独立端注册的会员为1',
  `area_id` int(11) NOT NULL DEFAULT '0' COMMENT '地区id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8 COMMENT='用户管理';

